(130227, 'undersea', '<C><F><I><N><Q>@undersea /''ʌndəsi:/<br />*  tính từ<br />- dưới mặt biển<br />*  phó từ+ (underseas) <br />/,ʌndə''si:z/<br />- dưới mặt biển</Q></N></I></F></C>'),
(130228, 'underseal', '<C><F><I><N><Q>@underseal<br />* danh từ<br />- lớp sơn lót (chất giống như hắc ín hoặc giống như cao su dùng để bảo vệ mặt dưới của một xe có động cơ chống gỉ )<br />* ngoại động từ<br />- lót mặt dưới của, bọc kín phần dưới của (một chiếc xe có động cơ ) bằng một lớp sơn bảo vệ</Q></N></I></F></C>'),
(130229, 'underseas', '<C><F><I><N><Q>@underseas /''ʌndəsi:/<br />*  tính từ<br />- dưới mặt biển<br />*  phó từ+ (underseas) <br />/,ʌndə''si:z/<br />- dưới mặt biển</Q></N></I></F></C>'),
(130230, 'undersecretary', '<C><F><I><N><Q>@undersecretary<br />* danh từ<br />- người trực tiếp dưới quyền một quan chức nhà nước có danh hiệu secretary; thứ trưởng; phó bí thư<br />- công chức cao cấp phụ trách một bộ của chính phủ; thứ trưởng<br />= To be Parliamentary undersecretary to the Treasury+làm thứ trưởng Bộ tài chính do Nghị viện cử</Q></N></I></F></C>'),
