(130264, 'understand', '<C><F><I><N><Q>@understand /,ʌndə''stænd/<br />*  động từ nderstood<br />- hiểu, nắm được ý, biết<br />=I don''t understand you+ tôi không hiểu ý anh<br />=to make oneself understood+ làm cho người ta hiểu mình<br />=to give a person to understand+ nói cho ai hiểu, làm cho ai tin<br />- hiểu ngầm (một từ không phát biểu trong câu)<br /><br />@understand<br />- hiểu</Q></N></I></F></C>'),
