(130267, 'understandably', '<C><F><I><N><Q>@understandably<br />* phó từ<br />- có thể hiểu được, có thể thông cảm được</Q></N></I></F></C>'),
(130268, 'understanding', '<C><F><I><N><Q>@understanding /,ʌndə''stændiɳ/<br />*  danh từ<br />- sự hiểu biết, sự am hiểu<br />=to have a good understanding of economics+ am hiểu về kinh tế<br />- óc thông minh, óc suy xét, trí tuệ<br />=he has an excellent understanding+ anh ấy rất thông minh<br />- quan niệm<br />=in my understanding of the matter+ theo quan niệm của tôi về việc này<br />- sự thoả thuận; sự thông cảm, sự hiểu nhau<br />=to come to an understanding with+ đi đến thoả thuận với<br />- điều kiện<br />=on this understanding+ với điều kiện này<br />=on the understanding that+ với điều kiện là<br />- (số nhiều) (từ lóng) chân, cẳng; giày, dép<br />*  tính từ<br />- hiểu biết<br />=an understanding man+ một người hiểu biết<br />- thông minh, sáng ý, mau hiểu</Q></N></I></F></C><C><F><I><N><Q>@understand /,ʌndə''stænd/<br />*  động từ nderstood<br />- hiểu, nắm được ý, biết<br />=I don''t understand you+ tôi không hiểu ý anh<br />=to make oneself understood+ làm cho người ta hiểu mình<br />=to give a person to understand+ nói cho ai hiểu, làm cho ai tin<br />- hiểu ngầm (một từ không phát biểu trong câu)<br /><br />@understand<br />- hiểu</Q></N></I></F></C>'),
(130269, 'understandingly', '<C><F><I><N><Q>@understandingly<br />- xem understanding</Q></N></I></F></C>'),
