(130342, 'underworld', '<C><F><I><N><Q>@underworld /''ʌndəwə:ld/<br />*  danh từ<br />- trần thế, thế gian, trần gian<br />- âm phủ, địa ngục<br />- bọn vô lại, lớp cặn bã của xã hội<br />- (văn học) đối cực</Q></N></I></F></C>'),
