(130347, 'underwriters', '<C><F><I><N><Q>@Underwriter<br />- (Econ) Người bảo hiểm.<br />+ Là người đồng ý chịu sự rủi ro hoặc một phần rủi ro và đổi lại được nhận một khoản gọi là phí bảo hiểm.</Q></N></I></F></C><C><F><I><N><Q>@underwriter /''ʌndə,raitə/<br />*  danh từ<br />- người bảo hiểm</Q></N></I></F></C>'),
