(130359, 'undesigned', '<C><F><I><N><Q>@undesigned /''ʌndi''zaind/<br />*  tính từ<br />- không cố ý, không định trước<br />=undesigned act+ hành động không cố ý<br />- bất ngờ, không dè<br />=undesigned result+ kết quả không ngờ</Q></N></I></F></C>'),
(130360, 'undesigning', '<C><F><I><N><Q>@undesigning<br />* tính từ<br />- không tính toán, không suy xét; không khôn ngoan; thật thà; đơn giản</Q></N></I></F></C>'),
(130361, 'undesirability', '<C><F><I><N><Q>@undesirability /''ʌndi,zaiərə''biliti/<br />*  danh từ<br />- tình trạng không ai ưa</Q></N></I></F></C>'),
(130362, 'undesirable', '<C><F><I><N><Q>@undesirable /''ʌndi''zaiərəbl/<br />*  tính từ<br />- không ai ưa, không ai thích<br />*  danh từ<br />- người không ai ưa</Q></N></I></F></C>'),
(130363, 'undesirably', '<C><F><I><N><Q>@undesirably<br />* phó từ<br />- có thể gây rắc rối, có thể gây phiền phức; không mong muốn<br />- không ai ưa, không ai thích, đáng chê trách (người, thói quen )</Q></N></I></F></C>'),
(130364, 'undesired', '<C><F><I><N><Q>@undesired /''ʌndi''zaiəd/<br />*  tính từ<br />- không được ưa thích, không được cầu xin</Q></N></I></F></C>'),
