(130366, 'undespairing', '<C><F><I><N><Q>@undespairing /''ʌndis''peəriɳ/<br />*  tính từ<br />- không thất vọng</Q></N></I></F></C>'),
(130367, 'undestroyable', '<C><F><I><N><Q>@undestroyable<br />* tính từ<br />- không phá được; không hủy hoại được</Q></N></I></F></C>'),
