(130370, 'undetected', '<C><F><I><N><Q>@undetected /''ʌndi''tektid/<br />*  tính từ<br />- không bị phát hiện, không bị khám phá ra</Q></N></I></F></C>'),
(130371, 'undeterminable', '<C><F><I><N><Q>@undeterminable<br />* tính từ<br />- không xác định được<br />- không quyết định được</Q></N></I></F></C>'),
(130372, 'undetermined', '<C><F><I><N><Q>@undetermined /''ʌndi''tə:mind/<br />*  tính từ<br />- chưa xác định, không xác minh được, không rõ; chưa quyết định<br />=an undetermined date+ ngày tháng không rõ<br />=an undetermined question+ vấn đề chưa quyết định<br />- lưỡng lự, do dự, không quả quyết<br />=an undetermined person+ một người do dự<br /><br />@undetermined<br />- bất định</Q></N></I></F></C>'),
(130373, 'undeterred', '<C><F><I><N><Q>@undeterred /''ʌndi''tə:d/<br />*  tính từ<br />- (+ by) không bị ngăn chặn, không ngã lòng, không nao núng</Q></N></I></F></C>'),
(130374, 'undeveloped', '<C><F><I><N><Q>@undeveloped /''ʌndi''veləpt/<br />*  tính từ<br />- không mở mang, không khuếch trương, không phát triển<br />- không khai khẩn (đất đai); không lớn (thú); còi (cây)<br />- chưa rửa (ảnh)<br />- chưa được phát triển (nước)<br />- không luyện tập, không rèn luyện, không mở mang trí tuệ, dốt (người)<br />=undeveloped mind+ óc dốt nát</Q></N></I></F></C>'),
(130375, 'undeviating', '<C><F><I><N><Q>@undeviating /ʌn''di:vieitiɳ/<br />*  tính từ<br />- thẳng, không rẽ, không ngoặt (con đường)<br />- (nghĩa bóng) không đi sai đường, không đi lệch hướng; chắc tay, chặt chẽ</Q></N></I></F></C>'),
(130376, 'undevised', '<C><F><I><N><Q>@undevised<br />* tính từ<br />- không tính trước; không có dự trù; không có kế hoạch<br />- (pháp luật) không có di chúc (về bất động sản)</Q></N></I></F></C>'),
