(130379, 'undid', '<C><F><I><N><Q>@undid /''ʌn''du:/<br />*  ngoại động từ undid; undone<br />- tháo, cởi, mở<br />=to undo a knitting+ tháo một cái áo đan<br />=to undo a parcel+ mở một gói<br />=to undo one''s dress+ mở khuy áo<br />- xoá, huỷ<br />=to undo a contract+ huỷ một hợp đồng<br />- phá hoại, làm cho đồi truỵ, làm hư hỏng, làm hại đến thanh danh<br />=drink has undone him+ rượu chè đã làm nó hư hỏng</Q></N></I></F></C><C><F><I><N><Q>@undo /''ʌn''du:/<br />*  ngoại động từ undid; undone<br />- tháo, cởi, mở<br />=to undo a knitting+ tháo một cái áo đan<br />=to undo a parcel+ mở một gói<br />=to undo one''s dress+ mở khuy áo<br />- xoá, huỷ<br />=to undo a contract+ huỷ một hợp đồng<br />- phá hoại, làm cho đồi truỵ, làm hư hỏng, làm hại đến thanh danh<br />=drink has undone him+ rượu chè đã làm nó hư hỏng</Q></N></I></F></C>'),
(130380, 'undidactic', '<C><F><I><N><Q>@undidactic<br />* tính từ<br />- không mô phạm; không sư phạm; không có tính cách nhà giáo</Q></N></I></F></C>'),
