(130401, 'undischarged', '<C><F><I><N><Q>@undischarged /''ʌndis''tʃɑ:dʤd/<br />*  tính từ<br />- (quân sự) chưa tháo đạn (súng)<br />- (quân sự) chưa giải ngủ (lính)<br />- (pháp lý) chưa được phục quyền; chưa trả, chưa thanh toán<br />=an undischarged bankrupt+ một người phá sản chưa được phục quyền<br />=an undischarged debt+ một món nợ chưa trả<br />- chưa được thả, chưa được tha, chưa được giải phóng<br />=an undischarged prisoner+ một người tù chưa được thả<br />- chưa làm trọn, chưa hoàn thành<br />=an undischarged duty+ một nhiệm vụ chưa hoàn thành</Q></N></I></F></C>'),
(130402, 'undisciplinable', '<C><F><I><N><Q>@undisciplinable<br />* tính từ<br />- không tuân thủ kỷ luật; không vâng lời</Q></N></I></F></C>'),
