(130406, 'undiscoloured', '<C><F><I><N><Q>@undiscoloured<br />- Cách viết khác : undiscolored</Q></N></I></F></C>'),
(130407, 'undiscomfited', '<C><F><I><N><Q>@undiscomfited /''ʌndis''kʌmfitid/<br />*  tính từ<br />- không bối rối, không lúng túng<br />- (quân sự) không bị đánh bại, không bị tiêu diệt</Q></N></I></F></C>'),
(130408, 'undisconcerted', '<C><F><I><N><Q>@undisconcerted /''ʌn,diskən''sə:tid/<br />*  tính từ<br />- không bối rối, không lúng túng, không luống cuống<br />- không bị đảo lộn (kế hoạch)</Q></N></I></F></C>'),
(130409, 'undiscountable', '<C><F><I><N><Q>@undiscountable /''ʌndis''kauntəbl/<br />*  tính từ<br />- không thể hạ bớt, không thể chiết khấu được</Q></N></I></F></C>'),
(130410, 'undiscouraged', '<C><F><I><N><Q>@undiscouraged /''ʌndis''kʌridʤd/<br />*  tính từ<br />- không nản chí, không nản lòng</Q></N></I></F></C>'),
(130411, 'undiscoverable', '<C><F><I><N><Q>@undiscoverable /''ʌndis''kauntəbl/<br />*  tính từ<br />- không thể phát hiện được, không thể tìm ra được</Q></N></I></F></C>');
INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(130412, 'undiscovered', '<C><F><I><N><Q>@undiscovered /''ʌndis''kʌvəd/<br />*  tính từ<br />- không được phát hiện, chưa được phát hiện, chưa bị phát giác; không tìm thấy, chưa tìm ra<br />=an undiscovered crime+ một tội ác không (chưa) bị phát giác<br />=an undiscovered criminal+ một tội nhân chưa tìm ra<br />- không ai biết<br />=an undiscovered place+ một nơi không ai biết</Q></N></I></F></C>'),
(130413, 'undiscriminated', '<C><F><I><N><Q>@undiscriminated<br />* tính từ<br />- không tách bạch, không rạch ròi</Q></N></I></F></C>'),
(130414, 'undiscriminating', '<C><F><I><N><Q>@undiscriminating /''ʌndis''krimineitiɳ/<br />*  tính từ<br />- không biết phân biệt, không biết suy xét<br />- bừa, ẩu</Q></N></I></F></C>'),
(130415, 'undiscussed', '<C><F><I><N><Q>@undiscussed /''ʌndis''kʌst/<br />*  tính từ<br />- không được bàn cãi; chưa được thảo luận<br />- không ai cãi lại</Q></N></I></F></C>'),
(130416, 'undisfigured', '<C><F><I><N><Q>@undisfigured<br />* tính từ<br />- không bị làm xấu đi; không bị bóp méo, không bị xuyên tạc</Q></N></I></F></C>'),
(130417, 'undisguised', '<C><F><I><N><Q>@undisguised /''ʌndis''kʌst/<br />*  tính từ<br />- không nguỵ trang, không đổi lốt<br />- không giả vờ, thành thật</Q></N></I></F></C>'),
(130418, 'undismayed', '<C><F><I><N><Q>@undismayed /''ʌndis''meid/<br />*  tính từ<br />- không nao núng</Q></N></I></F></C>'),
(130419, 'undispatched', '<C><F><I><N><Q>@undispatched<br />* tính từ<br />- không phát đi; không gửi đi</Q></N></I></F></C>'),
(130420, 'undispelled', '<C><F><I><N><Q>@undispelled /''ʌndis''peld/<br />*  tính từ<br />- không bị xua đuổi, không bị xua tan</Q></N></I></F></C>'),
(130421, 'undispersed', '<C><F><I><N><Q>@undispersed /''ʌndis''pə:st/<br />*  tính từ<br />- không bị giải tán, không phân tán<br />- không bị xua tan, không tan tác<br />- không bị rác rác, không bị gieo vãi<br />- không gieo rắc, không lan truyền</Q></N></I></F></C>'),
(130422, 'undisplayed', '<C><F><I><N><Q>@undisplayed /''ʌndis''pleid/<br />*  tính từ<br />- không được bày ra, không được trưng bày<br />- không phô trương, không khoe khoang<br />- không được biểu lộ ra, không được bày tỏ ra</Q></N></I></F></C>'),
(130423, 'undisposed', '<C><F><I><N><Q>@undisposed /''ʌndis''pouzd/<br />*  tính từ (+ of)<br />- chưa sử dụng đến, chưa dùng đến<br />- (thương nghiệp) chưa bán đi được, hãy còn<br />=stock undisposed of+ hàng hoá chưa bán đi được</Q></N></I></F></C>'),
(130424, 'undisproved', '<C><F><I><N><Q>@undisproved<br />* tính từ<br />- không bị bác bỏ</Q></N></I></F></C>'),
(130425, 'undisputable', '<C><F><I><N><Q>@undisputable<br />* tính từ<br />- không thể bàn cãi được; không thể bác bỏ được</Q></N></I></F></C>'),
(130426, 'undisputed', '<C><F><I><N><Q>@undisputed /''ʌndis''pju:tid/<br />*  tính từ<br />- không cãi được, không bác được<br />- không bị cãi lại<br />- không bị tranh giành, không bị tranh chấp</Q></N></I></F></C>'),
(130427, 'undissected', '<C><F><I><N><Q>@undissected /''ʌndi''sektid/<br />*  tính từ<br />- không bị cắt ra từng mảnh<br />- không bị mổ xẻ (con vật, thân cây)<br />- không được phân tích kỹ, không được khảo sát tỉ mỉ</Q></N></I></F></C>'),
(130428, 'undissembled', '<C><F><I><N><Q>@undissembled /''ʌndi''sembld/<br />*  tính từ<br />- không che giấu, không giấu giếm, không che đậy</Q></N></I></F></C>'),
(130429, 'undissembling', '<C><F><I><N><Q>@undissembling /''ʌndi''sembliɳ/<br />*  tính từ<br />- không giấu giếm, không giả trá, thành thật</Q></N></I></F></C>'),
(130430, 'undisseverable', '<C><F><I><N><Q>@undisseverable /''ʌndis''sevərəbl/<br />*  tính từ<br />- không thể chia cắt được</Q></N></I></F></C>'),
(130431, 'undissipeited', '<C><F><I><N><Q>@undissipeited<br />* tính từ<br />- không bị phung phí<br />- không bị tiêu tan<br />- không bị đãng trí</Q></N></I></F></C>'),
(130432, 'undissolvable', '<C><F><I><N><Q>@undissolvable /''ʌndi''zɔlvəbl/<br />*  tính từ<br />- không thể hoà tan được<br />- (nghĩa bóng) không thể dứt, không thể lìa, không thể phân ly<br />=undissolvable friendship+ tình bạn không thể dứt được, tình bạn keo sơn gắn bó<br />- (pháp lý) không thể huỷ bỏ được, không thể giải thể được<br />=an undissolvable contract+ một hợp đồng không thể huỷ bỏ được<br />=an undissolvable society+ một hội không thể giải thể được</Q></N></I></F></C>'),
(130433, 'undissolved', '<C><F><I><N><Q>@undissolved /''ʌndi''zɔlvd/<br />*  tính từ<br />- không bị hoà tan<br />- không bị huỷ bỏ, không bị giải thể</Q></N></I></F></C>'),
(130434, 'undistempered', '<C><F><I><N><Q>@undistempered<br />* tính từ<br />- không bị ốm; khoẻ mạnh<br />- thanh thản; không buồn phiền, không phiền muộn</Q></N></I></F></C>'),
(130435, 'undistilled', '<C><F><I><N><Q>@undistilled<br />* tính từ<br />- không được chưng cất; không được sàng lọc</Q></N></I></F></C>'),
(130436, 'undistinguishable', '<C><F><I><N><Q>@undistinguishable /''ʌndis''tiɳgwiʃəbl/<br />*  tính từ<br />- không thể phân biệt được; không rõ</Q></N></I></F></C>'),
(130437, 'undistinguished', '<C><F><I><N><Q>@undistinguished /''ʌndis''tiɳwiʃt/<br />*  tính từ<br />- không phân biệt<br />- tầm thường, xoàng, không bị xuyên tạc</Q></N></I></F></C>'),
(130438, 'undistorted', '<C><F><I><N><Q>@undistorted /''ʌndis''tɔ:tid/<br />*  tính từ<br />- không bị vặn, không bị méo mó<br />- không bị bóp méo, không bị xuyên tạc</Q></N></I></F></C>'),
(130439, 'undistracted', '<C><F><I><N><Q>@undistracted /''ʌndis''træktid/<br />*  tính từ<br />- không bị làm lãng trí</Q></N></I></F></C>'),
(130440, 'undistressed', '<C><F><I><N><Q>@undistressed /''ʌndis''trest/<br />*  tính từ<br />- không đau buồn, không phiền muộn<br />- không lo nghĩ</Q></N></I></F></C>'),
(130441, 'undistributed', '<C><F><I><N><Q>@undistributed /''ʌndis''tribjutid/<br />*  tính từ<br />- không được phân phối</Q></N></I></F></C>'),
(130442, 'Undistributed profits', '<C><F><I><N><Q>@Undistributed profits<br />- (Econ) Lợi nhuận không chia.<br />+ Là một tỷ lệ lợi nhuận được giữ lại không phân chia cho các cổ đông dưới dạng cổ tức cũng như không dùng để trả các khoản thuế.</Q></N></I></F></C>'),
(130443, 'undisturbed', '<C><F><I><N><Q>@undisturbed /''ʌndis''tə:bd/<br />*  tính từ<br />- yên tĩnh (cảnh); không bị phá rối (giấc ngủ...); không bị làm phiền, không bị quấy rầy, không lo âu (người); không bị xáo lộn (giấy tờ)</Q></N></I></F></C>'),
(130444, 'undiversified', '<C><F><I><N><Q>@undiversified /''ʌndai''və:sifaid/<br />*  tính từ<br />- không thay đổi, đều đều</Q></N></I></F></C>'),
(130445, 'undiverted', '<C><F><I><N><Q>@undiverted /''ʌndai''və:tid/<br />*  tính từ<br />- không bị hướng trệch đi, không đổi chiều, không quay sang ngả khác<br />- không được vui, không được khuây (người)</Q></N></I></F></C>'),
(130446, 'undivided', '<C><F><I><N><Q>@undivided /''ʌndi''vaidid/<br />*  tính từ<br />- không bị chia<br />- (nghĩa bóng) trọn vẹn, hoàn toàn</Q></N></I></F></C>'),
(130447, 'undivorced', '<C><F><I><N><Q>@undivorced /''ʌndi''vɔ:st/<br />*  tính từ<br />- không ly dị<br />- không bị tách rời</Q></N></I></F></C>'),
(130448, 'undivulged', '<C><F><I><N><Q>@undivulged /''ʌndai''vʌldʤd/<br />*  tính từ<br />- không bị tiết lộ</Q></N></I></F></C>'),
(130449, 'undo', '<C><F><I><N><Q>@undo /''ʌn''du:/<br />*  ngoại động từ undid; undone<br />- tháo, cởi, mở<br />=to undo a knitting+ tháo một cái áo đan<br />=to undo a parcel+ mở một gói<br />=to undo one''s dress+ mở khuy áo<br />- xoá, huỷ<br />=to undo a contract+ huỷ một hợp đồng<br />- phá hoại, làm cho đồi truỵ, làm hư hỏng, làm hại đến thanh danh<br />=drink has undone him+ rượu chè đã làm nó hư hỏng</Q></N></I></F></C>'),
(130450, 'undoable', '<C><F><I><N><Q>@undoable /''ʌn''du:əbl/<br />*  tính từ<br />- không thể tháo, không thể cởi, không thể mở<br />- không thể xoá, không thể huỷ<br />- không thể phá hoại, không thể làm hư hỏng</Q></N></I></F></C>'),
(130451, 'undock', '<C><F><I><N><Q>@undock /''ʌn''dɔk/<br />*  ngoại động từ<br />- không đưa (tàu) vào vũng tàu, không đưa (tàu) vào bến<br />- không xây dựng vũng tàu, không xây dựng bến tàu</Q></N></I></F></C>'),
(130452, 'undocking', '<C><F><I><N><Q>@undocking<br />* danh từ<br />- sự đưa ra khỏi bến (tàu, thuyền)<br />- sự tách rời; sự tháo rời (các con tàu vũ trụ)</Q></N></I></F></C>'),
(130453, 'undocumented', '<C><F><I><N><Q>@undocumented<br />* tính từ<br />- không được cung cấp tư liệu; không dựa vào tư liệu; không có cơ sở</Q></N></I></F></C>'),
(130454, 'undoer', '<C><F><I><N><Q>@undoer<br />- xem undo</Q></N></I></F></C>'),
(130455, 'undoes', '<C><F><I><N><Q>@undo /''ʌn''du:/<br />*  ngoại động từ undid; undone<br />- tháo, cởi, mở<br />=to undo a knitting+ tháo một cái áo đan<br />=to undo a parcel+ mở một gói<br />=to undo one''s dress+ mở khuy áo<br />- xoá, huỷ<br />=to undo a contract+ huỷ một hợp đồng<br />- phá hoại, làm cho đồi truỵ, làm hư hỏng, làm hại đến thanh danh<br />=drink has undone him+ rượu chè đã làm nó hư hỏng</Q></N></I></F></C>'),
(130456, 'undogmatic', '<C><F><I><N><Q>@undogmatic<br />* tính từ<br />- không thuộc giáo lý; không giáo điều<br />- không dứt khoát, không nhất quyết</Q></N></I></F></C>'),
(130457, 'undoing', '<C><F><I><N><Q>@undoing /''ʌn''du:iɳ/<br />*  danh từ (chỉ số ít)<br />- sự tháo, sự cởi, sự mở<br />- sự xoá, sự huỷ (cái gì đã làm)<br />- sự phá hoại, sự làm đồi truỵ, sự làm hư hỏng; sự làm hại đến thanh danh; cái phá hoại, cái làm đồi truỵ; cái làm hư hỏng<br />=drink was his undoing+ rượu là cái làm cho nó hư hỏng</Q></N></I></F></C><C><F><I><N><Q>@undo /''ʌn''du:/<br />*  ngoại động từ undid; undone<br />- tháo, cởi, mở<br />=to undo a knitting+ tháo một cái áo đan<br />=to undo a parcel+ mở một gói<br />=to undo one''s dress+ mở khuy áo<br />- xoá, huỷ<br />=to undo a contract+ huỷ một hợp đồng<br />- phá hoại, làm cho đồi truỵ, làm hư hỏng, làm hại đến thanh danh<br />=drink has undone him+ rượu chè đã làm nó hư hỏng</Q></N></I></F></C>'),
(130458, 'undomesticated', '<C><F><I><N><Q>@undomesticated /''ʌndə''mestikeitid/<br />*  tính từ<br />- không thạo công việc nội trợ; không màng đến việc gia đình (đàn bà)</Q></N></I></F></C>'),
(130459, 'undone', '<C><F><I><N><Q>@undone /''ʌn''dʌn/<br />*  động tính từ quá khứ của undo<br />*  tính từ<br />- không làm; chưa xong, bỏ dở<br />=he died with his work still undone+ ông ta mất đi để lại công việc còn bỏ dở</Q></N></I></F></C><C><F><I><N><Q>@undo /''ʌn''du:/<br />*  ngoại động từ undid; undone<br />- tháo, cởi, mở<br />=to undo a knitting+ tháo một cái áo đan<br />=to undo a parcel+ mở một gói<br />=to undo one''s dress+ mở khuy áo<br />- xoá, huỷ<br />=to undo a contract+ huỷ một hợp đồng<br />- phá hoại, làm cho đồi truỵ, làm hư hỏng, làm hại đến thanh danh<br />=drink has undone him+ rượu chè đã làm nó hư hỏng</Q></N></I></F></C>'),
(130460, 'undotted', '<C><F><I><N><Q>@undotted<br />* tính từ<br />- không đánh dấu chấm</Q></N></I></F></C>'),
(130461, 'undouble', '<C><F><I><N><Q>@undouble<br />* ngoại động từ<br />- mở (tờ báo)<br />* nội động từ<br />- xoè ra (nắm tay)</Q></N></I></F></C>'),
(130462, 'undoubtable', '<C><F><I><N><Q>@undoubtable<br />* tính từ<br />- không thể nghi ngờ được; chắc chắn, hiển nhiên</Q></N></I></F></C>'),
(130463, 'undoubted', '<C><F><I><N><Q>@undoubted /ʌn''dautid/<br />*  tính từ<br />- không nghi ngờ được, chắc chắn</Q></N></I></F></C>'),
(130464, 'undoubtedly', '<C><F><I><N><Q>@undoubtedly<br />* phó từ<br />- rõ ràng, chắc chắn, không thể tranh cãi được, không bị hoài nghi, không bị thắc mắc</Q></N></I></F></C>'),
(130465, 'undoubtful', '<C><F><I><N><Q>@undoubtful<br />* tính từ<br />- không gì phải nghi ngờ; rõ ràng</Q></N></I></F></C>'),
(130466, 'undoubting', '<C><F><I><N><Q>@undoubting /''ʌn''dautiɳ/<br />*  tính từ<br />- không nghi ngờ</Q></N></I></F></C>'),
(130467, 'undrainable', '<C><F><I><N><Q>@undrainable<br />* tính từ<br />- không thể tiêu nước được; không thể tháo khô<br />- không cạn</Q></N></I></F></C>'),
(130468, 'undrained', '<C><F><I><N><Q>@undrained<br />* tính từ<br />- không tiêu nước, chưa tiêu nước, không tháo khô, chưa tháo khô</Q></N></I></F></C>'),
(130469, 'undramatic', '<C><F><I><N><Q>@undramatic<br />* tính từ<br />- không có tính chất kịch; không thích hợp với sân khấu<br />- không có kịch tính</Q></N></I></F></C>'),
(130470, 'undramatised', '<C><F><I><N><Q>@undramatised<br />- Cách viết khác : undramatized</Q></N></I></F></C>'),
(130471, 'undramatized', '<C><F><I><N><Q>@undramatized<br />- Cách viết khác : undramatised</Q></N></I></F></C>'),
(130472, 'undraped', '<C><F><I><N><Q>@undraped /''ʌn''dreipt/<br />*  tính từ<br />- không treo màn, không treo trướng; không trang trí bằng màn, không trang trí bằng trướng<br />- không xếp nếp (quần áo, màn treo)</Q></N></I></F></C>'),
(130473, 'undraw', '<C><F><I><N><Q>@undraw<br />* ngoại động từ<br />- (undrew,  undrawn)</Q></N></I></F></C>'),
(130474, 'undrawn', '<C><F><I><N><Q>@undrawn<br />- past part của undraw</Q></N></I></F></C>'),
