(130476, 'undreamt-of', '<C><F><I><N><Q>@undreamt-of /ʌn''dremtɔv/ (undreamt-of) /ʌn''dremtɔv/<br />-of) <br />/ʌn''dremtɔv/<br />*  tính từ<br />- không mơ tưởng đến, không ngờ<br />=an undreamed-of happening+ một sự kiện không ngờ</Q></N></I></F></C>'),
