(130539, 'unedifying', '<C><F><I><N><Q>@unedifying /''ʌn''edifaiiɳ/<br />*  tính từ<br />- không có tác dụng mở mang trí óc<br />- hàm ý xấu xa, phạm đến luân thường đạo lý</Q></N></I></F></C>'),
(130540, 'unedited', '<C><F><I><N><Q>@unedited /''ʌn''editid/<br />*  tính từ<br />- không được thu thập và diễn giải<br />- không được biên soạn, không được biên tập; không được chọn lọc, không bị cắt xén, không thêm bớt (tin của phóng viên báo gửi về)</Q></N></I></F></C>'),
(130541, 'uneducable', '<C><F><I><N><Q>@uneducable<br />* tính từ<br />- không thể giáo dục được, không thể rèn luyện được</Q></N></I></F></C>'),
(130542, 'uneducated', '<C><F><I><N><Q>@uneducated /''ʌn''edjukeitid/<br />*  tính từ<br />- không được giáo dục<br />- vô học, không có học thức</Q></N></I></F></C>'),
(130543, 'uneffaced', '<C><F><I><N><Q>@uneffaced /''ʌni''feist/<br />*  tính từ<br />- không bị xoá</Q></N></I></F></C>'),
(130544, 'uneffected', '<C><F><I><N><Q>@uneffected /''ʌni''lektid/<br />*  tính từ<br />- không làm, không được thực hiện</Q></N></I></F></C>'),
(130545, 'unelaborate', '<C><F><I><N><Q>@unelaborate<br />* tính từ<br />- không tỉ mỉ, không chi tiết<br />- không phức tạp; đơn giản</Q></N></I></F></C>'),
(130546, 'unelaborated', '<C><F><I><N><Q>@unelaborated<br />* tính từ<br />- không được sửa soạn công phu; không được soạn thảo tỉ mỉ<br />- không trở thành tỉ mỉ, không trở thành tinh vi</Q></N></I></F></C>'),
(130547, 'unelated', '<C><F><I><N><Q>@unelated<br />* tính từ<br />- không phấn chấn, không phấn khởi<br />- không hãnh diện, không tự hào</Q></N></I></F></C>'),
(130548, 'unelectable', '<C><F><I><N><Q>@unelectable<br />* tính từ<br />- không thể chọn lọc<br />- không thể bầu được</Q></N></I></F></C>'),
(130549, 'unelected', '<C><F><I><N><Q>@unelected /''ʌni''fektid/<br />*  tính từ<br />- không được bầu, không trúng cử</Q></N></I></F></C>'),
(130550, 'unelectrified', '<C><F><I><N><Q>@unelectrified<br />* tính từ<br />- không được điện khí hoá<br />- không nhiễm điện</Q></N></I></F></C>'),
(130551, 'uneliminated', '<C><F><I><N><Q>@uneliminated /''ʌni''limineitid/<br />*  tính từ<br />- không bị loại ra</Q></N></I></F></C>'),
(130552, 'uneloquent', '<C><F><I><N><Q>@uneloquent<br />* tính từ<br />- không hùng hồn, không hùng biện</Q></N></I></F></C>'),
(130553, 'unelucidated', '<C><F><I><N><Q>@unelucidated /''ʌni''lu:sideitid/<br />*  tính từ<br />- không được giải rõ; chưa được làm sáng tỏ</Q></N></I></F></C>'),
(130554, 'unemancipated', '<C><F><I><N><Q>@unemancipated /''ʌni''mænsipeitid/<br />*  tính từ<br />- không được giải phóng; chưa được giải phóng</Q></N></I></F></C>'),
(130555, 'unembarrassed', '<C><F><I><N><Q>@unembarrassed /''ʌnim''bærəst/<br />*  tính từ<br />- không bị ngăn trở<br />- không lúng túng; không ngượng nghịu<br />- không nợ nần</Q></N></I></F></C>'),
(130556, 'unembellished', '<C><F><I><N><Q>@unembellished<br />* tính từ<br />- không được trang điểm, không được tô điểm<br />- không tô vẽ; chân thật</Q></N></I></F></C>'),
(130557, 'unembittered', '<C><F><I><N><Q>@unembittered<br />* tính từ<br />- không bực tức, không tức giận, không cáu, không điên tiết<br />- không buồn, không phiền muộn</Q></N></I></F></C>'),
(130558, 'unembodied', '<C><F><I><N><Q>@unembodied /''ʌnim''bɔdid/<br />*  tính từ<br />- vô thể, vô hình<br />- không hợp vào, không gộp vào (trong một thể)</Q></N></I></F></C>'),
(130559, 'unemotional', '<C><F><I><N><Q>@unemotional /''ʌni''mouʃənl/<br />*  tính từ<br />- không xúc cảm; khó cảm động</Q></N></I></F></C>'),
(130560, 'unemotionally', '<C><F><I><N><Q>@unemotionally<br />- xem unemotional</Q></N></I></F></C>'),
(130561, 'unemotive', '<C><F><I><N><Q>@unemotive<br />* tính từ<br />- như unemotional</Q></N></I></F></C>'),
(130562, 'unemphatic', '<C><F><I><N><Q>@unemphatic /''ʌnim''fætik/<br />*  tính từ<br />- không hùng hồn, không mạnh mẽ<br />- đọc không nhấn mạnh (từ)</Q></N></I></F></C>'),
(130563, 'unemphatically', '<C><F><I><N><Q>@unemphatically /''ʌnim''fætikəli/<br />*  phó từ<br />- không hùng hồn, không mạnh mẽ<br />- không nhấn mạnh</Q></N></I></F></C>'),
(130564, 'unempirical', '<C><F><I><N><Q>@unempirical<br />* tính từ<br />- không theo lối kinh nghiệm; không kinh nghiệm chủ nghĩa</Q></N></I></F></C>'),
(130565, 'unemployable', '<C><F><I><N><Q>@unemployable /''ʌnim''plɔiəbl/<br />*  tính từ<br />- không thể dùng, không thể cho việc làm được</Q></N></I></F></C>'),
(130566, 'unemployed', '<C><F><I><N><Q>@unemployed /''ʌnim''plɔid/<br />*  tính từ<br />- không dùng, không được sử dụng<br />- không có việc làm, thất nghiệp</Q></N></I></F></C>'),
(130567, 'Unemployment', '<C><F><I><N><Q>@Unemployment<br />- (Econ) Thất nghiệp.<br />+ Là những người lao động không có việc làm, bao gồm cả những người đang trong giai đoạn tìm việc làm mới hoặc những người không thể tìm được việc làm với đồng lương thực tế hiện hành.</Q></N></I></F></C>'),
(130568, 'unemployment', '<C><F><I><N><Q>@unemployment /''ʌnim''plɔimənt/<br />*  danh từ<br />- sự thất nghiệp; nạn thấp nghiệp<br />- khối lượng công việc chưa làm</Q></N></I></F></C>'),
(130569, 'Unemployment benefit', '<C><F><I><N><Q>@Unemployment benefit<br />- (Econ) Trợ cấp thất nghiệp.<br />+ Khoản thanh toán cho một cá nhân thất nghiệp.</Q></N></I></F></C>'),
(130570, 'unemployment benefit', '<C><F><I><N><Q>@unemployment benefit<br />* danh từ<br />- tiền trợ cấp thất nghiệp</Q></N></I></F></C>'),
(130571, 'unemployment compensation', '<C><F><I><N><Q>@unemployment compensation<br />* danh từ<br />- tiền trợ cấp thất nghiệp</Q></N></I></F></C>'),
(130572, 'Unemployment equilibrium', '<C><F><I><N><Q>@Unemployment equilibrium<br />- (Econ) Cân bằng thất nghiệp.<br />+ Định đề trung tâm của Keynes trong cuốn Lý thuyết tổng quát  rằng ngay cả khi tiền công và giá cả hoàn toàn linh hoạt như được giả định trong thuyết cổ điển, nền kinh tế vẫn không luôn luôn trở về điểm đầy đủ việc làm.</Q></N></I></F></C>'),
(130573, 'Unemployment rate', '<C><F><I><N><Q>@Unemployment rate<br />- (Econ) Tỷ lệ thất nghiệp.<br />+ Ở Anh, là tỷ lệ người trong lực lượng lao động không có việc làm và tích cực tìm kiếm việc làm.</Q></N></I></F></C>'),
(130574, 'unempowered', '<C><F><I><N><Q>@unempowered /''ʌnim''pauəd/<br />*  tính từ<br />- không cho quyền, không trao quyền, không cho phép</Q></N></I></F></C>'),
(130575, 'unemptied', '<C><F><I><N><Q>@unemptied<br />* tính từ<br />- không (bị) dốc sạch; không trút hết<br />- không trống rỗng, không trống trại</Q></N></I></F></C>'),
(130576, 'unenchanted', '<C><F><I><N><Q>@unenchanted<br />* tính từ<br />- không bị bùa mê; không bị phù phép<br />- không bị say mê</Q></N></I></F></C>'),
(130577, 'unenclosed', '<C><F><I><N><Q>@unenclosed /''ʌnin''kouzd/<br />*  tính từ<br />- không có gì vây quanh<br />- không kèm theo (trong phong bì với thư)</Q></N></I></F></C>'),
(130578, 'unencumbered', '<C><F><I><N><Q>@unencumbered /''ʌnin''kʌmbəd/<br />*  tính từ<br />- không bị làm lúng túng, không bị làm trở ngại, không bị làm vướng víu</Q></N></I></F></C>'),
(130579, 'unendangered', '<C><F><I><N><Q>@unendangered /''ʌnin''deindʤəd/<br />*  tính từ<br />- không bị làm nguy hiểm, không bị gây nguy hiểm</Q></N></I></F></C>'),
(130580, 'unendearing', '<C><F><I><N><Q>@unendearing<br />* tính từ<br />- không thân ái</Q></N></I></F></C>'),
(130581, 'unending', '<C><F><I><N><Q>@unending /ʌn''endiɳ/<br />*  tính từ<br />- không dứt, không hết, vô tận<br />- bất diệt, trường cửu<br />- (thông tục) thường kỳ, thường xuyên</Q></N></I></F></C>'),
(130582, 'unendingness', '<C><F><I><N><Q>@unendingness /ʌn''endiɳnis/<br />*  danh từ<br />- sự không dứt, sự không hết<br />- sự bất diệt, sự trường cửu</Q></N></I></F></C>'),
(130583, 'unendorsed', '<C><F><I><N><Q>@unendorsed /''ʌnin''dɔ:st/<br />*  tính từ<br />- không được chứng thực đằng sau (séc...)<br />- không được xác nhận; không được tán thành (lời nói...)</Q></N></I></F></C>'),
(130584, 'unendowed', '<C><F><I><N><Q>@unendowed /''ʌnin''daud/<br />*  tính từ<br />- không được phú cho</Q></N></I></F></C>'),
(130585, 'unendurable', '<C><F><I><N><Q>@unendurable /''ʌnin''fɔ:səbl/<br />*  tính từ<br />- không thể chịu đựng được, khó chịu đựng</Q></N></I></F></C>'),
(130586, 'unenduring', '<C><F><I><N><Q>@unenduring<br />* tính từ<br />- không có sức chịu đựng, không quen chịu đựng</Q></N></I></F></C>'),
(130587, 'unenforceable', '<C><F><I><N><Q>@unenforceable /''ʌnin''fɔ:səbl/<br />*  tính từ<br />- không thể thi hành được (bản án)</Q></N></I></F></C>'),
(130588, 'unenforced', '<C><F><I><N><Q>@unenforced /''ʌnin''fɔ:st/<br />*  tính từ<br />- không thi hành (bản án, luật)</Q></N></I></F></C>'),
(130589, 'unenfranchised', '<C><F><I><N><Q>@unenfranchised /''ʌnin''fræntʃaizd/<br />*  tính từ<br />- không được giải phóng<br />- không có quyền bầu cử (công dân)</Q></N></I></F></C>'),
(130590, 'unengaged', '<C><F><I><N><Q>@unengaged /''ʌnin''geidʤd/<br />*  tính từ<br />- không có hẹn với ai, không bận, rảnh; chưa đính hôn, chưa hứa hôn<br />- chưa ai giữ, chưa ai thuê (chỗ ngồi, căn phòng...)</Q></N></I></F></C>'),
(130591, 'unengaging', '<C><F><I><N><Q>@unengaging<br />* tính từ<br />- không hấp dẫn<br />- không bắt buộc</Q></N></I></F></C>'),
(130592, 'unenjoyable', '<C><F><I><N><Q>@unenjoyable /''ʌnin''dʤɔiəbl/<br />*  tính từ<br />- không thú vị, không thích thú</Q></N></I></F></C>'),
(130593, 'unenlarged', '<C><F><I><N><Q>@unenlarged<br />* tính từ<br />- không được phóng to; không được mở rộng; chật hẹp</Q></N></I></F></C>'),
(130594, 'unenlightened', '<C><F><I><N><Q>@unenlightened /''ʌnin''laitnd/<br />*  tính từ<br />- không được làm sáng tỏ<br />- không được làm giải thoát khỏi (mê tín...)</Q></N></I></F></C>'),
(130595, 'unenlightening', '<C><F><I><N><Q>@unenlightening<br />* tính từ<br />- không có tác dụng chiếu sáng<br />- không có tác dụng làm sáng tỏ</Q></N></I></F></C>'),
(130596, 'unenlivened', '<C><F><I><N><Q>@unenlivened<br />* tính từ<br />- không được hồi sinh; không được làm sống động, không được làm rộn rịp<br />- đơn điệu</Q></N></I></F></C>'),
(130597, 'unenriched', '<C><F><I><N><Q>@unenriched<br />* tính từ<br />- không được làm cho giàu lên; không giàu thêm<br />- không được làm giàu (quặng)</Q></N></I></F></C>'),
(130598, 'unenrolled', '<C><F><I><N><Q>@unenrolled /''ʌnin''rould/<br />*  tính từ<br />- không được tuyển (quân)<br />- không được kếp nạp vào, không được ghi tên vào (hội...)<br />- không được ghi vào (sổ sách toà án)</Q></N></I></F></C>'),
(130599, 'unenslaved', '<C><F><I><N><Q>@unenslaved /''ʌnin''sleivd/<br />*  tính từ<br />- không bị nô dịch hoá</Q></N></I></F></C>'),
(130600, 'unentailed', '<C><F><I><N><Q>@unentailed<br />* tính từ<br />- (pháp luật) không bị hạn chế trong việc thừa kế hoặc trưng dụng (tài sản)</Q></N></I></F></C>'),
(130601, 'unentangled', '<C><F><I><N><Q>@unentangled<br />* tính từ<br />- không bị rối<br />- không bị ràng buộc<br />- không có quan hệ yêu đương</Q></N></I></F></C>'),
(130602, 'unentered', '<C><F><I><N><Q>@unentered<br />* tính từ<br />- không ghi vào sổ sách; không đăng ký<br />- không khai báo hải quan (hành lý)</Q></N></I></F></C>'),
(130603, 'unenterprising', '<C><F><I><N><Q>@unenterprising /''ʌn''entəpraiziɳ/<br />*  tính từ<br />- không dám làm, không có gan làm (việc gì)</Q></N></I></F></C>'),
(130604, 'unenterprisingness', '<C><F><I><N><Q>@unenterprisingness /''ʌn''entəpraiziɳnis/<br />*  danh từ<br />- tính không dám làm</Q></N></I></F></C>'),
(130605, 'unentertaining', '<C><F><I><N><Q>@unentertaining /''ʌn,entə''teiniɳ/<br />*  tính từ<br />- không làm cho vui, tẻ nhạt</Q></N></I></F></C>'),
(130606, 'unentertainingness', '<C><F><I><N><Q>@unentertainingness /''ʌn,entə''teiniɳnis/<br />*  danh từ<br />- tính tẻ nhạt</Q></N></I></F></C>'),
(130607, 'unenthusiastic', '<C><F><I><N><Q>@unenthusiastic /''ʌnin,θju:zi''æstik/<br />*  tính từ<br />- không hăng hái, không nhiệt tình</Q></N></I></F></C>'),
(130608, 'unenticing', '<C><F><I><N><Q>@unenticing<br />* tính từ<br />- không có tính chất dụ dỗ, không có tính chất lôi kéo, không có tính chất hấp dẫn</Q></N></I></F></C>'),
(130609, 'unentitled', '<C><F><I><N><Q>@unentitled /''ʌnin''taitld/<br />*  tính từ<br />- không được quyền, không được phép (làm việc gì)</Q></N></I></F></C>'),
(130610, 'unenumerated', '<C><F><I><N><Q>@unenumerated /''ʌni''nju:məreitid/<br />*  tính từ<br />- không đếm; không kê ra</Q></N></I></F></C>'),
(130611, 'unenviable', '<C><F><I><N><Q>@unenviable /''ʌn''enviəbl/<br />*  tính từ<br />- không đáng thèm muốn, không đáng ghen tị</Q></N></I></F></C>'),
(130612, 'unenvied', '<C><F><I><N><Q>@unenvied /''ʌn''envid/<br />*  tính từ<br />- không ai thềm muốn, không ai ghen tị</Q></N></I></F></C>'),
(130613, 'unenvious', '<C><F><I><N><Q>@unenvious<br />* tính từ<br />- không ganh tị, không ghen ghét</Q></N></I></F></C>'),
(130614, 'unenvying', '<C><F><I><N><Q>@unenvying /''ʌn''enviiɳ/<br />*  tính từ<br />- không ghen tị</Q></N></I></F></C>'),
(130615, 'unepiscopal', '<C><F><I><N><Q>@unepiscopal<br />* tính từ<br />- không thuộc giám mục; không thuộc giáo hội</Q></N></I></F></C>'),
(130616, 'unequability', '<C><F><I><N><Q>@unequability<br />* danh từ<br />- tính chất không ổn định; tính chất không đều; tính chất thay đổi</Q></N></I></F></C>'),
(130617, 'unequable', '<C><F><I><N><Q>@unequable<br />* tính từ<br />- không ổn định; không đều; thay đổi</Q></N></I></F></C>'),
(130618, 'unequal', '<C><F><I><N><Q>@unequal /''ʌn''i:kwəl/<br />*  tính từ<br />- không bằng, không ngang, không đều<br />=unequal parts+ những phần không đều nhau<br />=unequal pulse+ mạch không đều<br />- thật thường<br />=unequal temper+ tính khí thất thường<br />- không bình đẳng<br />=unequal treaty+ hiệp ước không bình đẳng<br />- không vừa sức, không kham nổi<br />=to be unequal to doing something+ không kham nổi việc gì, không đủ sức làm việc gì<br />- không đồng đều từ đầu đến cuối, đoạn hay đoạn dở (bài viết)<br /><br />@unequal<br />- không cân bằng, không bằng</Q></N></I></F></C>'),
(130619, 'Unequal exchange', '<C><F><I><N><Q>@Unequal exchange<br />- (Econ) Sự trao đổi không ngang bằng.<br />+ Nói một cách chính xác theo quan điểm của C.Mác, đó là sự trao đổi sản phẩm của các nền kinh tế phát triển với giá cao hơn giá trị lao động của chúng.</Q></N></I></F></C>'),
(130620, 'unequalable', '<C><F><I><N><Q>@unequalable<br />* tính từ<br />- không ngang tài, không ngang sức<br />- vô song</Q></N></I></F></C>'),
(130621, 'unequalise', '<C><F><I><N><Q>@unequalise /''ʌn''i:kwəlaiz/ (unequalize) /''ʌn''i:kwəlaiz/<br />*  ngoại động từ<br />- không làm bằng, không làm ngang<br />- không gỡ hoà (bóng đá...)</Q></N></I></F></C>'),
(130622, 'unequalize', '<C><F><I><N><Q>@unequalize /''ʌn''i:kwəlaiz/ (unequalize) /''ʌn''i:kwəlaiz/<br />*  ngoại động từ<br />- không làm bằng, không làm ngang<br />- không gỡ hoà (bóng đá...)</Q></N></I></F></C>'),
(130623, 'unequalled', '<C><F><I><N><Q>@unequalled /''ʌn''i:kwəld/<br />*  tính từ<br />- không ai bằng, không ai sánh kịp; vô địch, vô song<br />=unequalled in heroism+ anh hùng không ai sánh kịp</Q></N></I></F></C>'),
(130624, 'unequally', '<C><F><I><N><Q>@unequally<br />- xem unequal</Q></N></I></F></C>'),
(130625, 'unequipped', '<C><F><I><N><Q>@unequipped /''ʌni''kwipt/<br />*  tính từ<br />- không được trang bị những thứ cần thiết</Q></N></I></F></C>'),
(130626, 'unequitable', '<C><F><I><N><Q>@unequitable /''ʌn''ekwitəbl/<br />*  tính từ<br />- không công bình</Q></N></I></F></C>'),
(130627, 'unequivocal', '<C><F><I><N><Q>@unequivocal /''ʌni''kwivəkəl/<br />*  tính từ<br />- không thể giải thích hai cách, không thể lập lờ nước đôi, rõ rệt<br />=unequivocal position+ lập trường rõ rệt</Q></N></I></F></C>'),
(130628, 'unequivocally', '<C><F><I><N><Q>@unequivocally<br />- xem unequivocal</Q></N></I></F></C>'),
(130629, 'unequivocalness', '<C><F><I><N><Q>@unequivocalness /''ʌni''kwivəklnis/<br />*  danh từ<br />- tính không thể giải thích hai cách, tính không thể lập lờ nước đôi, tính rõ rệt</Q></N></I></F></C>'),
(130630, 'uneradicable', '<C><F><I><N><Q>@uneradicable<br />* tính từ<br />- không thể nhổ lên được; không thể trừ bỏ được; thâm căn cố đế</Q></N></I></F></C>'),
(130631, 'uneradicated', '<C><F><I><N><Q>@uneradicated /''ʌni''rædikeitid/<br />*  tính từ<br />- không bị nhổ rễ<br />- không bị trừ tiệt</Q></N></I></F></C>'),
(130632, 'unerased', '<C><F><I><N><Q>@unerased /''ʌni''reizd/<br />*  tính từ<br />- không xoá, không xoá bỏ</Q></N></I></F></C>'),
(130633, 'unerotic', '<C><F><I><N><Q>@unerotic<br />* tính từ<br />- không thuộc tình ái, không thuộc tình dục<br />- (từ Mỹ, nghĩa Mỹ) không gợi tình, không khiêu dâm</Q></N></I></F></C>'),
(130634, 'unerring', '<C><F><I><N><Q>@unerring /''ʌn''ə:riɳ/<br />*  tính từ<br />- không sai, chính xác<br />=unerring in one''s judgment+ chính xác trong nhận xét của mình</Q></N></I></F></C>'),
(130635, 'unerringly', '<C><F><I><N><Q>@unerringly<br />- xem unerring</Q></N></I></F></C>'),
(130636, 'unerringness', '<C><F><I><N><Q>@unerringness /''ʌn''ə:riɳnis/<br />*  danh từ<br />- sự không sai, sự chính xác</Q></N></I></F></C>'),
(130637, 'unescapable', '<C><F><I><N><Q>@unescapable /''ʌnis''keipəbl/<br />*  tính từ<br />- không thể tránh được, không thể thoát được</Q></N></I></F></C>'),
(130638, 'unesco', '<C><F><I><N><Q>@unesco /ju:''neskou/<br />*  danh từ<br />- UNESCO ((viết tắt) của United Uations Educational,  Scientific and Cultural Organization) tổ chức giáo dục, khoa học và văn hoá của Liên hiệp quốc</Q></N></I></F></C>'),
(130639, 'unescorted', '<C><F><I><N><Q>@unescorted /''ʌnis''kɔ:tid/<br />*  tính từ<br />- không ai hộ tống</Q></N></I></F></C>'),
(130640, 'unespied', '<C><F><I><N><Q>@unespied /''ʌnis''paid/<br />*  tính từ<br />- không ai nhìn thấy, không bị phát hiện</Q></N></I></F></C>'),
(130641, 'unessayed', '<C><F><I><N><Q>@unessayed /''ʌne''seid/<br />*  tính từ<br />- không được thử, không được làm thử<br />- không được thử thách</Q></N></I></F></C>'),
(130642, 'unessential', '<C><F><I><N><Q>@unessential /''ʌni''senʃəl/<br />*  tính từ<br />- không thiết yếu, thứ yếu<br />=the unessential points+ những điểm không thiết yếu, những điểm phụ<br />*  danh từ<br />- cái phụ, cái thứ yếu<br /><br />@unessential<br />- không cốt yếu</Q></N></I></F></C>');
INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(130643, 'unestablished', '<C><F><I><N><Q>@unestablished /''ʌnis''tæbliʃt/<br />*  tính từ<br />- không được thiếp lập<br />- không được xác minh<br />- chưa chính thức hoá (nhà thờ)<br />- chưa định<br />- phụ động, tạm tuyển (nhân viên)</Q></N></I></F></C>'),
(130644, 'unestimable', '<C><F><I><N><Q>@unestimable /''ʌn''estiməbl/<br />*  tính từ<br />- không thể đánh giá được, không thể ước lượng được, vô giá</Q></N></I></F></C>'),
(130645, 'unestimated', '<C><F><I><N><Q>@unestimated /''ʌn''estimeitid/<br />*  tính từ<br />- không được đánh giá; không ước lượng</Q></N></I></F></C>'),
(130646, 'unestranged', '<C><F><I><N><Q>@unestranged /''ʌnis''treindʤd/<br />*  tính từ<br />- không bị làm cho xa lạ, không bị làm cho ghẻ lạnh</Q></N></I></F></C>'),
(130647, 'unethical', '<C><F><I><N><Q>@unethical /''ʌn''eθikəl/<br />*  tính từ<br />- không thuộc luân thường đạo lý<br />- (từ Mỹ,nghĩa Mỹ) trái với luân thường đạo lý; không đúng với nguyên tắc xử thế (một cá nhân); không đúng nội quy (một tổ chức)</Q></N></I></F></C>'),
(130648, 'unevacuable', '<C><F><I><N><Q>@unevacuable<br />* tính từ<br />- không thể đưa đi, không thể tháo đi; không thể cho sơ tán, không thể cho tản cư</Q></N></I></F></C>'),
(130649, 'unevadable', '<C><F><I><N><Q>@unevadable<br />* tính từ<br />- không thể trốn thoát, không thể lẩn tránh</Q></N></I></F></C>'),
(130650, 'unevaluated', '<C><F><I><N><Q>@unevaluated<br />* tính từ<br />- không được ước lượng<br />- không được định giá</Q></N></I></F></C>'),
(130651, 'unevangelical', '<C><F><I><N><Q>@unevangelical /''ʌn,i:væn''dʤelikəl/<br />*  tính từ<br />- không thuộc kinh Phúc âm</Q></N></I></F></C>'),
(130652, 'unevaporated', '<C><F><I><N><Q>@unevaporated /''ʌni''væpəreitid/<br />*  tính từ<br />- không bị bay hơi</Q></N></I></F></C>'),
(130653, 'uneven', '<C><F><I><N><Q>@uneven /''ʌn''i:vən/<br />*  tính từ<br />- không phẳng, gồ ghề, gập ghềnh (đường, đất...)<br />- (toán học) lẻ (số)<br />- thất thường, hay thay đổi (tính tình...)<br /><br />@uneven<br />- không chẵn</Q></N></I></F></C>'),
(130654, 'unevenly', '<C><F><I><N><Q>@unevenly<br />* phó từ<br />- không bằng phẳng, không nhẵn, không đều, gồ ghề, gập ghềnh (đường, đất...)<br />- &lt;toán&gt; lẻ (số)<br />- không đồng dạng, không bằng nhau (vật thể, hình dáng...)<br />- không cân sức (cuộc thi, trận đấu )<br />- thay đổi, không đều<br />- thất thường, hay thay đổi (tính tình...)</Q></N></I></F></C>'),
(130655, 'unevenness', '<C><F><I><N><Q>@unevenness /''ʌn''i:vnnis/<br />*  danh từ<br />- tình trạng không phẳng, tình trạng gồ ghề, tình trạng gập gềnh<br />- tính thất thường, tính hay thay đổi</Q></N></I></F></C>'),
(130656, 'uneventful', '<C><F><I><N><Q>@uneventful /''ʌni''ventful/<br />*  tính từ<br />- không có chuyện gì xảy ra, không có biến cố; yên ổn</Q></N></I></F></C>'),
(130657, 'uneventfully', '<C><F><I><N><Q>@uneventfully<br />- xem uneventful</Q></N></I></F></C>'),
(130658, 'uneventfulness', '<C><F><I><N><Q>@uneventfulness /''ʌni''ventfulnis/<br />*  danh từ<br />- tình trạng không có biến cố; không yên ổn</Q></N></I></F></C>'),
(130659, 'unevident', '<C><F><I><N><Q>@unevident<br />* tính từ<br />- không hiển nhiên, không rõ ràng</Q></N></I></F></C>'),
(130660, 'unexact', '<C><F><I><N><Q>@unexact<br />- (từ hiếm, nghĩa hiếm) xem inexact</Q></N></I></F></C>'),
(130661, 'unexacting', '<C><F><I><N><Q>@unexacting<br />* tính từ<br />- không đòi hỏi; không có tính chất phê bình, không có tính chất phê phán</Q></N></I></F></C>'),
(130662, 'unexaggerated', '<C><F><I><N><Q>@unexaggerated<br />* tính từ<br />- không nói quá, không thổi phồng; không tô vẽ</Q></N></I></F></C>'),
(130663, 'unexamined', '<C><F><I><N><Q>@unexamined /''ʌnig''zæmind/<br />*  tính từ<br />- không bị xem xét, không bị khám xét, không bị tra xét<br />- không bị sát hạch (thí sinh)<br />- (pháp lý) không bị thẩm vấn (nhân chứng)</Q></N></I></F></C>'),
(130664, 'unexamining', '<C><F><I><N><Q>@unexamining<br />* tính từ<br />- không xét nét, không đòi hỏi; không chín chắn, không thận trọng</Q></N></I></F></C>'),
(130665, 'unexampled', '<C><F><I><N><Q>@unexampled /,ʌnig''zɑ:mpld/<br />*  tính từ<br />- không tiền khoáng hậu, vô song</Q></N></I></F></C>'),
(130666, 'unexcavated', '<C><F><I><N><Q>@unexcavated<br />* tính từ<br />- không bị đào lên; chưa bị khai quật</Q></N></I></F></C>'),
(130667, 'unexceeded', '<C><F><I><N><Q>@unexceeded<br />* tính từ<br />- không bị vượt quá</Q></N></I></F></C>'),
(130668, 'unexcelled', '<C><F><I><N><Q>@unexcelled /''ʌnik''seld/<br />*  tính từ<br />- không ai hơn, không ai vượt</Q></N></I></F></C>'),
(130669, 'unexceptionable', '<C><F><I><N><Q>@unexceptionable /,ʌnik''sepʃnəbl/<br />*  tính từ<br />- không thể chê trách được, không thể bắt bẻ được<br />- (pháp lý) không thể bác được</Q></N></I></F></C>'),
(130670, 'unexceptionableness', '<C><F><I><N><Q>@unexceptionableness /,ʌnik''sepʃnəblnis/<br />*  danh từ<br />- tính không thể chê trách được, tính không thể bắt bẻ được<br />- (pháp lý) tính chất không thể bác được</Q></N></I></F></C>'),
(130671, 'unexceptionably', '<C><F><I><N><Q>@unexceptionably<br />* phó từ<br />- không thể chỉ trích được, không thể bắt bẻ được; hoàn toàn thoả mãn<br />- &lt;pháp&gt; không thể bác được</Q></N></I></F></C>'),
(130672, 'unexceptional', '<C><F><I><N><Q>@unexceptional<br />* tính từ<br />- không nổi bật, không khác thường, hoàn toàn bình thường</Q></N></I></F></C>'),
(130673, 'unexceptionally', '<C><F><I><N><Q>@unexceptionally<br />* phó từ<br />- không nổi bật, không khác thường, hoàn toàn bình thường</Q></N></I></F></C>'),
(130674, 'unexchangeable', '<C><F><I><N><Q>@unexchangeable<br />* tính từ<br />- không tiện lợi để trao đổi, không tiện lợi để đổi chác</Q></N></I></F></C>'),
(130675, 'unexcised', '<C><F><I><N><Q>@unexcised /''ʌnek''sɑizd/<br />*  tính từ<br />- không bị đánh thuế môn bài[''ʌnek''saizd]<br />*  tính từ<br />- không bị cắt (đoạn sách, bộ phận trong cơ thể)</Q></N></I></F></C>'),
(130676, 'unexcitable', '<C><F><I><N><Q>@unexcitable<br />* tính từ<br />- không dễ bị kích động, không dễ bị kích thích</Q></N></I></F></C>'),
(130677, 'unexcited', '<C><F><I><N><Q>@unexcited<br />* tính từ<br />- không bị kích thích, không bị kích động</Q></N></I></F></C>'),
(130678, 'unexciting', '<C><F><I><N><Q>@unexciting<br />* tính từ<br />- không kích thích, không kích động<br />- không hứng thú, không lý thú; buồn chán; tẻ nhạt</Q></N></I></F></C>'),
(130679, 'unexclusive', '<C><F><I><N><Q>@unexclusive /''ʌniks''klu:siv/<br />*  tính từ<br />- không bị loại trừ<br />- không dành riêng (câu lạc bộ, cửa hàng...); không độc quyền, không độc chiếm</Q></N></I></F></C>'),
(130680, 'unexcusable', '<C><F><I><N><Q>@unexcusable /''ʌniks''kju:zəbl/<br />*  tính từ<br />- không thể tha lỗi được</Q></N></I></F></C>'),
(130681, 'unexcusableness', '<C><F><I><N><Q>@unexcusableness /''ʌniks''kju:zəblnis/<br />*  danh từ<br />- tính không thể tha lỗi được</Q></N></I></F></C>'),
(130682, 'unexcused', '<C><F><I><N><Q>@unexcused<br />* tính từ<br />- không được tha lỗi, không được tha thứ</Q></N></I></F></C>'),
(130683, 'unexecuted', '<C><F><I><N><Q>@unexecuted /''ʌn''eksikju:tid/<br />*  tính từ<br />- không thực hiện, không làm; chưa thi hành, chưa làm<br />- chưa bị hành hình; không bị hành hình (người bị án tử hình)</Q></N></I></F></C>'),
(130684, 'unexemplified', '<C><F><I><N><Q>@unexemplified /''ʌnig''zemplifaid/<br />*  tính từ<br />- không được minh hoạ bằng thí dụ<br />- không được sao y (một văn kiện)</Q></N></I></F></C>'),
(130685, 'unexercised', '<C><F><I><N><Q>@unexercised /''ʌn''eksəsaizd/<br />*  tính từ<br />- không được thực hiện, không được thi hành; không được sử dụng<br />- không được tập luyện, không được rèn luyện<br />- không được thử thách<br />- không bị quấy rầy, không bị làm phiền</Q></N></I></F></C>'),
(130686, 'unexhausted', '<C><F><I><N><Q>@unexhausted /''ʌnig''zɔ:stid/<br />*  tính từ<br />- không bị hút (không khí, hơi, nước, bụi...)<br />- không bị kiệt, không bị cạn; không dùng hết<br />- không mệt lử, không kiệt sức<br />- không được bàn hết khía cạnh, không được nghiên cứu hết mọi mặt (vấn đề)</Q></N></I></F></C>'),
(130687, 'unexhaustible', '<C><F><I><N><Q>@unexhaustible<br />* tính từ<br />- không thể hút sách<br />- không thể cạn, không thể kiệt</Q></N></I></F></C>'),
(130688, 'unexpanded', '<C><F><I><N><Q>@unexpanded<br />* tính từ<br />- không được mở rộng, không được triển khai, không được phổ biến</Q></N></I></F></C>'),
(130689, 'unexpansive', '<C><F><I><N><Q>@unexpansive<br />* tính từ<br />- không thể mở rộng, không thể bành trướng; không thể nở ra, không thể giãn ra<br />- không cởi mở, không chan hoà; dè dặt</Q></N></I></F></C>'),
(130690, 'unexpectant', '<C><F><I><N><Q>@unexpectant<br />* tính từ<br />- không chờ đợi</Q></N></I></F></C>'),
(130691, 'unexpected', '<C><F><I><N><Q>@unexpected /''ʌniks''pektid/<br />*  tính từ<br />- không mong đợi, không ngờ, thình lình<br />=an unexpected piece of luck+ một sự may mắn không ngờ<br />*  danh từ<br />- điều không ngờ<br />=it is the unexpected that happens+ chính điều không ngờ lại xảy ra</Q></N></I></F></C>'),
(130692, 'Unexpected inflation', '<C><F><I><N><Q>@Unexpected inflation<br />- (Econ) Lạm phát bất thường..</Q></N></I></F></C>'),
(130693, 'unexpectedly', '<C><F><I><N><Q>@unexpectedly<br />* phó từ<br />- bất ngờ, thình lình, đột xuất; gây ngạc nhiên</Q></N></I></F></C>'),
(130694, 'unexpectedness', '<C><F><I><N><Q>@unexpectedness /''ʌniks''pektidnis/<br />*  danh từ<br />- tính không ngờ, tính thình lình</Q></N></I></F></C>'),
(130695, 'unexpeditious', '<C><F><I><N><Q>@unexpeditious<br />* tính từ<br />- không chóng vánh, không mau lẹ, không khẩn trương</Q></N></I></F></C>'),
(130696, 'unexpended', '<C><F><I><N><Q>@unexpended<br />* tính từ<br />- không tiêu đến<br />- không dùng hết, không dùng cạn</Q></N></I></F></C>'),
(130697, 'unexpensive', '<C><F><I><N><Q>@unexpensive /''ʌniks''pensiv/<br />*  tính từ<br />- không đắt tiền<br />- không xa hoa, xoàng xĩnh</Q></N></I></F></C>'),
(130698, 'unexperienced', '<C><F><I><N><Q>@unexperienced /''ʌniks''piəriənst/<br />*  tính từ<br />- chưa qua thử thách, chưa có kinh nghiệm, thiếu kinh nghiệm</Q></N></I></F></C>'),
(130699, 'unexperimented', '<C><F><I><N><Q>@unexperimented<br />* tính từ<br />- không được tôi luyện, không được thử thách<br />- không được đưa ra thử nghiệm</Q></N></I></F></C>'),
(130700, 'unexpiated', '<C><F><I><N><Q>@unexpiated /''ʌn''ekspieitid/<br />*  tính từ<br />- không được chuộc, không được đền (tội)</Q></N></I></F></C>'),
(130701, 'unexpired', '<C><F><I><N><Q>@unexpired /''ʌniks''paiəd/<br />*  tính từ<br />- chưa hết hạn, còn hiệu lực</Q></N></I></F></C>'),
(130702, 'unexplainable', '<C><F><I><N><Q>@unexplainable /''ʌniks''pleinəbl/<br />*  tính từ<br />- không cắt nghĩa được, không giải thích được</Q></N></I></F></C>'),
(130703, 'unexplained', '<C><F><I><N><Q>@unexplained /''ʌniks''pleind/<br />*  tính từ<br />- không được giải thích</Q></N></I></F></C>'),
