(130705, 'unexploded', '<C><F><I><N><Q>@unexploded /,ʌniks''ploudid/<br />*  tính từ<br />- không nổ (bom, đạn đại bác)</Q></N></I></F></C>'),
(130706, 'unexploited', '<C><F><I><N><Q>@unexploited /''ʌniks''plɔitid/<br />*  tính từ<br />- chưa khai thác; không được khai thác</Q></N></I></F></C>'),
(130707, 'unexplored', '<C><F><I><N><Q>@unexplored /,ʌniks''plɔ:d/<br />*  tính từ<br />- chưa ai thăm dò, chưa ai thám hiểm, chưa có dấu người đi đến<br />- (y học) chưa thông dò<br />=unexplored wound+ vết thương chưa thông dò</Q></N></I></F></C>'),
(130708, 'unexposed', '<C><F><I><N><Q>@unexposed /''ʌniks''pouzd/<br />*  tính từ<br />- không bày ra, không trưng bày<br />- không bị đặt vào nơi nguy hiểm<br />- chưa bị phát giác, chưa bị vạch trần; không bị lột mặt nạ<br />=an unexposed crime+ một tội chưa bị phát giác</Q></N></I></F></C>'),
(130709, 'unexpounded', '<C><F><I><N><Q>@unexpounded /''ʌniks''paundid/<br />*  tính từ<br />- không được trình bày chi tiết, trình bày qua loa<br />- không được giải thích, không được dẫn giải</Q></N></I></F></C>'),
(130710, 'unexpressed', '<C><F><I><N><Q>@unexpressed /''ʌniks''prest/<br />*  tính từ<br />- không được nói ra, không được phát biểu ra, không được diễn đạt<br />- (ngôn ngữ học) hiểu ngầm</Q></N></I></F></C>'),
(130711, 'unexpressible', '<C><F><I><N><Q>@unexpressible /,ʌniks''presəbl/<br />*  tính từ<br />- không thể diễn đạt được (ý nghĩ...)</Q></N></I></F></C>'),
(130712, 'unexpressive', '<C><F><I><N><Q>@unexpressive /''ʌniks''presiv/<br />*  tính từ<br />- không biểu lộ, không diễn cảm, thản nhiên (bộ mặt)</Q></N></I></F></C>'),
