(130715, 'unexpurgated', '<C><F><I><N><Q>@unexpurgated /''ʌn''ekspə:geitid/<br />*  tính từ<br />- không được sàng lọc; không được cắt bỏ (những chỗ không thích hợp trong một cuốn sách)</Q></N></I></F></C>'),
(130716, 'unextended', '<C><F><I><N><Q>@unextended /''ʌniks''tendid/<br />*  tính từ<br />- không gia hạn, không kéo dài<br />- không chiếm chỗ<br />- không có kích thước</Q></N></I></F></C>'),
(130717, 'unextenuated', '<C><F><I><N><Q>@unextenuated<br />* tính từ<br />- không bị suy yếu, không dịu đi</Q></N></I></F></C>'),
(130718, 'unextinct', '<C><F><I><N><Q>@unextinct<br />* tính từ<br />- không tắt, chưa tắt<br />- không mất đi, còn lưu giữ</Q></N></I></F></C>'),
(130719, 'unextinguishable', '<C><F><I><N><Q>@unextinguishable /,ʌniks''tiɳgwiʃəbl/<br />*  tính từ<br />- không thể tắt, không thể dập tắt được<br />- không thể tiêu diệt được</Q></N></I></F></C>'),
(130720, 'unextinguished', '<C><F><I><N><Q>@unextinguished /''ʌniks''tiɳgwiʃt/<br />*  tính từ<br />- chưa tắt (đèn); chưa chấm dứt, chưa bị dập tắt<br />- chưa trả hết (nợ)</Q></N></I></F></C>'),
(130721, 'unextirpated', '<C><F><I><N><Q>@unextirpated<br />* tính từ<br />- không nhổ rễ<br />- không trừ tận gốc, không trừ tiệt</Q></N></I></F></C>'),
(130722, 'unextorted', '<C><F><I><N><Q>@unextorted<br />* tính từ<br />- không bị cưỡng đoạt, không bị cưỡng ép; tự nguyện</Q></N></I></F></C>'),
(130723, 'unextraordinary', '<C><F><I><N><Q>@unextraordinary<br />* tính từ<br />- không đặc biệt; không khác thường; bình thường</Q></N></I></F></C>'),
(130724, 'uneyed', '<C><F><I><N><Q>@uneyed<br />* tính từ<br />- không trông thấy, không nhìn thấy</Q></N></I></F></C>'),
(130725, 'unfabled', '<C><F><I><N><Q>@unfabled<br />* tính từ<br />- tồn tại thực sự; có thật không bày đặt</Q></N></I></F></C>'),
(130726, 'unface', '<C><F><I><N><Q>@unface /''ʌn''feis/<br />*  ngoại động từ<br />- vạch mặt</Q></N></I></F></C>'),
(130727, 'unfadable', '<C><F><I><N><Q>@unfadable /''ʌn''feidəbl/<br />*  tính từ<br />- không thể héo được<br />- không thể phai được (màu)<br />- không thể phai nhạt được</Q></N></I></F></C>'),
(130728, 'unfading', '<C><F><I><N><Q>@unfading /ʌn''feidiɳ/<br />*  tính từ<br />- không héo, không tàn đi<br />- không phai<br />- không phai nhạt; không quên được<br />=unfading memories+ những kỷ niệm không phai nhạt được</Q></N></I></F></C>'),
(130729, 'unfadingly', '<C><F><I><N><Q>@unfadingly<br />- xem unfading</Q></N></I></F></C>'),
(130730, 'unfadingness', '<C><F><I><N><Q>@unfadingness /ʌn''feidiɳnis/<br />*  danh từ<br />- tính không héo, tính không tàn đi<br />- tính không phai<br />- tính không phai nhạt; tính không quên được</Q></N></I></F></C>'),
(130731, 'unfailing', '<C><F><I><N><Q>@unfailing /ʌn''feiliɳ/<br />*  tính từ<br />- không bao giờ cạn, không bao giờ hết<br />=an unfailing supply+ một nguồn tiếp tế không bao giờ cạn<br />- công hiệu (thuốc); chắc chắn (sự thành công); không bao giờ sai (trí nhớ...); luôn luôn có thể tin cậy được<br />=an unfailing friend+ một người bạn luôn luôn có thể tin cậy được</Q></N></I></F></C>'),
(130732, 'unfailingly', '<C><F><I><N><Q>@unfailingly<br />* phó từ<br />- luôn luôn, lúc nào cũng</Q></N></I></F></C>'),
(130733, 'unfailingness', '<C><F><I><N><Q>@unfailingness /ʌn''feiliɳnis/<br />*  danh từ<br />- tính không bao giờ cạn, tính không bao giờ hết<br />- tính công hiệu; tính chắc chắn; tính không bao giờ sai; tính luôn luôn có thể tin cậy được</Q></N></I></F></C>'),
(130734, 'unfain', '<C><F><I><N><Q>@unfain<br />* tính từ<br />- (phương ngữ; từ cổ, nghĩa cổ) không bằng lòng, không vui lòng</Q></N></I></F></C>'),
(130735, 'unfainting', '<C><F><I><N><Q>@unfainting<br />* tính từ<br />- không suy giảm; vững vàng; dũng cảm</Q></N></I></F></C>'),
(130736, 'unfair', '<C><F><I><N><Q>@unfair /''ʌn''feə/<br />*  tính từ<br />- bất công, không công bằng, thiên vị (người); không ngay thẳng, không đúng đắn; gian tà, gian lận<br />=unfair play+ lối chơi gian lận<br />- quá chừng, quá mức, thái quá<br />=unfair price+ giá quá đắt</Q></N></I></F></C>'),
(130737, 'unfairly', '<C><F><I><N><Q>@unfairly<br />* phó từ<br />- không đúng, không công bằng, bất công<br />- gian lận, không ngay thẳng; không theo các luật lệ bình thường, không theo các nguyên tắc bình thường</Q></N></I></F></C>'),
(130738, 'unfairness', '<C><F><I><N><Q>@unfairness /''ʌn''feənis/<br />*  danh từ<br />- sự bất công, sự thiên vị; sự gian lận</Q></N></I></F></C>'),
(130739, 'unfaithful', '<C><F><I><N><Q>@unfaithful /''ʌn''feiθful/<br />*  tính từ<br />- không trung thành, phản bội<br />- (nghĩa bóng) không trung thực, sai sự thật (bản báo cáo)</Q></N></I></F></C>'),
(130740, 'unfaithfully', '<C><F><I><N><Q>@unfaithfully<br />* phó từ<br />- không chung thủy, phạm tội ngoại tình<br />- không trung thành, phản bội<br />- &lt;bóng&gt; không trung thực, sai sự thật (bản báo cáo)</Q></N></I></F></C>'),
(130741, 'unfaithfulness', '<C><F><I><N><Q>@unfaithfulness /''ʌn''feiθfulnis/<br />*  danh từ<br />- tính không trung thành, tính phản bội<br />- tính không trung thực, tính sai sự thật</Q></N></I></F></C>'),
