(130752, 'unfashionable', '<C><F><I><N><Q>@unfashionable /''ʌn''fæʃnəbl/<br />*  tính từ<br />- không đúng mốt, không hợp thời trang</Q></N></I></F></C>'),
(130753, 'unfashionableness', '<C><F><I><N><Q>@unfashionableness /''ʌn''fæʃnəblnis/<br />*  danh từ<br />- tính không đúng mốt, tính không hợp thời trang</Q></N></I></F></C>'),
