(130763, 'unfathomable', '<C><F><I><N><Q>@unfathomable /ʌn''fæðəməbl/<br />*  tính từ<br />- khó dò, không dò được (vực sâu, sông sâu...)<br />- không dò ra, không hiểu thấu (điều bí mật...)</Q></N></I></F></C>'),
(130764, 'unfathomableness', '<C><F><I><N><Q>@unfathomableness /ʌn''fæðəməblnis/<br />*  danh từ<br />- tính khó dò, tính không dò được<br />- tính không dò ra, tính không hiểu thấu</Q></N></I></F></C>'),
(130765, 'unfathomed', '<C><F><I><N><Q>@unfathomed /''ʌn''fæðəmd/<br />*  tính từ<br />- chưa dò (vực sâu, sông sâu...)<br />- chưa hiểu thấu (điều bí mật...)<br />- khó dò, khó hiểu (tính tình...)</Q></N></I></F></C>'),
