(130768, 'unfatiguing', '<C><F><I><N><Q>@unfatiguing<br />* tính từ<br />- không làm cho mệt mỏi; không nhọc nhằn, không vất vả, không gian lao</Q></N></I></F></C>'),
(130769, 'unfaulty', '<C><F><I><N><Q>@unfaulty<br />* tính từ<br />- (từ cổ, nghĩa cổ) không có lỗi, không có tội; vô tội</Q></N></I></F></C>'),
(130770, 'unfavourable', '<C><F><I><N><Q>@unfavourable /''ʌn''feivərəbl/<br />*  tính từ<br />- không có thiện chí; không thuận, không tán thành<br />- không thuận lợi<br />- không hứa hẹn tốt, không có triển vọng<br />- không có lợi, không có ích<br />=unfavourable to us+ không có lợi cho chúng ta<br /><br />@unfavourable<br />- không thuận lợi</Q></N></I></F></C>'),
(130771, 'unfavourableness', '<C><F><I><N><Q>@unfavourableness /''ʌn''feivərəblnis/<br />*  danh từ<br />- tính chất không thuận lợi<br />- sự không có triển vọng</Q></N></I></F></C>'),
(130772, 'unfavoured', '<C><F><I><N><Q>@unfavoured<br />* tính từ<br />- không được ưu tiên; không có đặc quyền đặc lợi</Q></N></I></F></C>'),
(130773, 'unfavourite', '<C><F><I><N><Q>@unfavourite<br />* tính từ<br />- không được mến chuộng, không được ưa thích</Q></N></I></F></C>'),
(130774, 'unfazed', '<C><F><I><N><Q>@unfazed<br />* tính từ<br />- (từ Mỹ, nghĩa Mỹ; (thông tục)) không bị làm phiền; không bối rối, không lúng túng</Q></N></I></F></C>'),
(130775, 'unfearing', '<C><F><I><N><Q>@unfearing<br />* tính từ<br />- không sợ sệt; dũng cảm; gan dạ</Q></N></I></F></C>'),
(130776, 'unfeasible', '<C><F><I><N><Q>@unfeasible /''ʌn''fi:zəbl/<br />*  tính từ<br />- không thể thực hành được, không thể thực hiện được, không thể làm được<br />- không tiện lợi<br />- không thể tin được, nghe không xuôi tai</Q></N></I></F></C>'),
(130777, 'unfeather', '<C><F><I><N><Q>@unfeather /''ʌn''feðə/<br />*  ngoại động từ<br />- vặt lông</Q></N></I></F></C>'),
(130778, 'unfeathered', '<C><F><I><N><Q>@unfeathered<br />* tính từ<br />- không có lông (vũ)<br />- chưa mọc lông<br />= unfeathered brood+lứa chim chưa mọc lông<br />- đã vặt lông, đã nhổ lông</Q></N></I></F></C>'),
(130779, 'unfeatured', '<C><F><I><N><Q>@unfeatured<br />* tính từ<br />- không có đường nét<br />- không được đề cao</Q></N></I></F></C>'),
