(130795, 'unfertile', '<C><F><I><N><Q>@unfertile<br />* tính từ<br />- không tốt mỡ, không màu mỡ<br />= unfertile land+đất cằn cỗi<br />- không ra quả; bất thụ; thui; lép</Q></N></I></F></C>'),
(130796, 'unfertilized', '<C><F><I><N><Q>@unfertilized /''ʌn''fə:tilaizd/<br />*  tính từ<br />- không được bón phân (đất)<br />- (sinh vật học) không được thụ tinh, không được làm thụ thai</Q></N></I></F></C>'),
(130797, 'unfestive', '<C><F><I><N><Q>@unfestive<br />* tính từ<br />- không thuộc ngày lễ, không thuộc ngày hội<br />- không vui, không tưng bừng, không rộn rịp</Q></N></I></F></C>'),
(130798, 'unfetter', '<C><F><I><N><Q>@unfetter /''ʌn''fetə/<br />*  ngoại động từ<br />- tháo xiềng, mở cùm<br />- (nghĩa bóng) giải phóng</Q></N></I></F></C>'),
(130799, 'unfettered', '<C><F><I><N><Q>@unfettered /''ʌn''fetəd/<br />*  tính từ<br />- không bị xiềng chân, không bị cùm<br />- (nghĩa bóng) được giải phóng, tự do<br />=to act unfettered+ tự do hành động</Q></N></I></F></C>'),
(130800, 'unfeudalize', '<C><F><I><N><Q>@unfeudalize /''ʌn''fju:dəlaiz/<br />*  ngoại động từ<br />- làm cho mất tính chất phong kiến</Q></N></I></F></C>'),
(130801, 'unfightable', '<C><F><I><N><Q>@unfightable<br />* tính từ<br />- (quân sự) không chiến đấu; chưa sẵn sàng chiến đấu</Q></N></I></F></C>'),
(130802, 'unfigured', '<C><F><I><N><Q>@unfigured<br />* tính từ<br />- không thêu ren; không có hoạ tiết, không có hoa văn<br />- không vẽ người<br />- (văn học) không có hình ảnh</Q></N></I></F></C>'),
(130803, 'unfile', '<C><F><I><N><Q>@unfile /''ʌn''fail/<br />*  ngoại động từ<br />- rút ra khỏi hồ sơ</Q></N></I></F></C>'),
(130804, 'unfiled', '<C><F><I><N><Q>@unfiled<br />* tính từ<br />- không dính vào hồ sơ; bị rút khỏi hồ sơ (tài liệu)</Q></N></I></F></C>'),
(130805, 'unfilial', '<C><F><I><N><Q>@unfilial /''ʌn''filjəl/<br />*  tính từ<br />- bất hiếu, không đúng với đạo làm con</Q></N></I></F></C>'),
