(130811, 'unfinished', '<C><F><I><N><Q>@unfinished /''ʌn''finiʃt/<br />*  tính từ<br />- chưa xong, chưa hoàn thành; bỏ dở<br />- không hoàn chỉnh</Q></N></I></F></C>'),
(130812, 'unfired', '<C><F><I><N><Q>@unfired<br />- không được thắp lên, không được đốt cháy<br />- không nung (gạch...)<br />- không hào hứng, không phấn chấn<br />- chưa bị bắn</Q></N></I></F></C>'),
(130813, 'unfit', '<C><F><I><N><Q>@unfit /''ʌn''fit/<br />*  tính từ<br />- không dùng được; làm cho không thích hợp; không đủ năng lực, thiếu khả năng, thiếu tư cách<br />=road unfit for motor traffic+ đường không dùng cho ô tô chạy được<br />=to be unfit for a doctor+ không đủ năng lực (tư cách) làm bác sĩ<br />- (y học); (quân sự) không đủ sức khoẻ<br />*  nội động từ<br />- làm cho không dùng được; làm cho không thích hợp; làm cho không đủ năng lực, làm cho không đủ tư cách</Q></N></I></F></C>'),
(130814, 'unfitly', '<C><F><I><N><Q>@unfitly<br />- xem unfit</Q></N></I></F></C>'),
(130815, 'unfitness', '<C><F><I><N><Q>@unfitness /''ʌn''fitnis/<br />*  danh từ<br />- sự không thích hợp; sự thiếu khả năng<br />- (y học) tình trạng thiếu sức khoẻ<br />=physical unfitness+ tình trạng thiếu sức khoẻ</Q></N></I></F></C>'),
