(130817, 'unfitted', '<C><F><I><N><Q>@unfitted /ʌn''fitid/<br />*  tính từ<br />- không thích hợp; không đủ khả năng, không đủ sức; không có các tiện nghi</Q></N></I></F></C><C><F><I><N><Q>@unfit /''ʌn''fit/<br />*  tính từ<br />- không dùng được; làm cho không thích hợp; không đủ năng lực, thiếu khả năng, thiếu tư cách<br />=road unfit for motor traffic+ đường không dùng cho ô tô chạy được<br />=to be unfit for a doctor+ không đủ năng lực (tư cách) làm bác sĩ<br />- (y học); (quân sự) không đủ sức khoẻ<br />*  nội động từ<br />- làm cho không dùng được; làm cho không thích hợp; làm cho không đủ năng lực, làm cho không đủ tư cách</Q></N></I></F></C>'),
(130818, 'unfitting', '<C><F><I><N><Q>@unfitting /''ʌn''fitiɳ/<br />*  tính từ<br />- không thích hợp; không vừa (quần áo); không ăn ý, không ăn khớp</Q></N></I></F></C><C><F><I><N><Q>@unfit /''ʌn''fit/<br />*  tính từ<br />- không dùng được; làm cho không thích hợp; không đủ năng lực, thiếu khả năng, thiếu tư cách<br />=road unfit for motor traffic+ đường không dùng cho ô tô chạy được<br />=to be unfit for a doctor+ không đủ năng lực (tư cách) làm bác sĩ<br />- (y học); (quân sự) không đủ sức khoẻ<br />*  nội động từ<br />- làm cho không dùng được; làm cho không thích hợp; làm cho không đủ năng lực, làm cho không đủ tư cách</Q></N></I></F></C>'),
(130819, 'unfix', '<C><F><I><N><Q>@unfix /''ʌn''fiks/<br />*  ngoại động từ<br />- tháo ra, mở ra, cởi ra, bỏ ra<br />*  nội động từ<br />- bung ra, rời ra</Q></N></I></F></C>'),
(130820, 'unfixed', '<C><F><I><N><Q>@unfixed /ʌn''fikst/<br />*  tính từ<br />- tháo ra, mở ra, cởi ra, bỏ ra</Q></N></I></F></C>'),
(130821, 'unflagging', '<C><F><I><N><Q>@unflagging /ʌn''flægiɳ/<br />*  tính từ<br />- không mệt mỏi, không rã rời; không nao nung, không suy yếu<br />=unflagging struggle+ sự đấu tranh không mệt mỏi<br />- không kém đi (sự chú ý, sự quan tâm)</Q></N></I></F></C>'),
(130822, 'unflaggingly', '<C><F><I><N><Q>@unflaggingly<br />* phó từ<br />- không mệt mỏi, không có dấu hiệu mệt mỏi, không nao núng, không rã rời; không nao nung<br />- không kém đi (sự chú ý, sự quan tâm)</Q></N></I></F></C>'),
(130823, 'unflamboyant', '<C><F><I><N><Q>@unflamboyant<br />* tính từ<br />- không chói lọi, không rực rỡ, không sặc sỡ, không loè loẹt</Q></N></I></F></C>'),
