(130830, 'unflawed', '<C><F><I><N><Q>@unflawed<br />* tính từ<br />- không rạn nứt<br />- không vấy bẩn; không tì vết; hoàn hảo<br />= an unflawed sky+bầu trời trong sáng</Q></N></I></F></C>'),
(130831, 'unflecked', '<C><F><I><N><Q>@unflecked<br />* tính từ<br />- sạch; không bị lốm đốm<br />- không bị tàn nhang, không bị tàn hương</Q></N></I></F></C>'),
(130832, 'unfledged', '<C><F><I><N><Q>@unfledged /''ʌn''fledʤd/<br />*  tính từ<br />- (động vật học) chưa đủ lông (chim)<br />- (nghĩa bóng) chưa có kinh nghiệm, còn non nớt, chưa từng trải<br />- không được trang trí bằng lông</Q></N></I></F></C>'),
(130833, 'unfleshed', '<C><F><I><N><Q>@unfleshed<br />* tính từ<br />- không bị kích thích; không hăng máu (chó săn)<br />- (văn học) không có kinh nghiệm; chưa qua thử thách</Q></N></I></F></C>'),
