(130837, 'unflinching', '<C><F><I><N><Q>@unflinching /ʌn''flintʃiɳ/<br />*  tính từ<br />- không chùn bước, không nao núng; vững vàng<br />- không ngập ngừng, không do dự; thản nhiên, điềm nhiên</Q></N></I></F></C>'),
(130838, 'unflinchingly', '<C><F><I><N><Q>@unflinchingly<br />* phó từ<br />- không nao núng, không tỏ ra sợ hãi, không chùn bước, thản nhiên (trước khó khăn, nguy hiểm )<br />- không ngập ngừng, không do dự; thản nhiên, điềm nhiên</Q></N></I></F></C>'),
(130839, 'unflinchingness', '<C><F><I><N><Q>@unflinchingness /ʌn''flintʃiɳnis/<br />*  danh từ<br />- tính không cùn bước, tính vững vàng<br />- tính thản nhiên, tính điềm nhiên</Q></N></I></F></C>'),
(130840, 'unflower', '<C><F><I><N><Q>@unflower /''ʌn''flauə/<br />*  ngoại động từ<br />- làm hoa không nở, làm không ra hoa</Q></N></I></F></C>'),
