(130847, 'unfold', '<C><F><I><N><Q>@unfold /ʌn''fould/<br />*  ngoại động từ<br />- mở ra, trải ra<br />=to unfold a newpaper+ mở một tờ báo ra<br />- bày tỏ, để lộ, bộc lộ<br />=to unfold one''s intention+ bộc lộ ý định của mình<br />*  nội động từ<br />- lộ ra, bày ra; mở ra (nụ hoa)</Q></N></I></F></C>'),
(130848, 'unfolded', '<C><F><I><N><Q>@unfold /ʌn''fould/<br />*  ngoại động từ<br />- mở ra, trải ra<br />=to unfold a newpaper+ mở một tờ báo ra<br />- bày tỏ, để lộ, bộc lộ<br />=to unfold one''s intention+ bộc lộ ý định của mình<br />*  nội động từ<br />- lộ ra, bày ra; mở ra (nụ hoa)</Q></N></I></F></C>'),
