(131098, 'unheard', '<C><F><I><N><Q>@unheard /''ʌn''hə:d/<br />*  tính từ<br />- không nghe thấy, không ai nghe<br />=the ship''s SOS was unheard+ không ai nghe thấy tiếng cầu cứu của chiếc tàu<br />- không nghe phát biểu ý kiến<br />=it is unjust to condemn a prisoner unheard+ không nghe một tù nhân biện bạch mà đã kết án là không công bằng</Q></N></I></F></C>'),
(131099, 'unheard-of', '<C><F><I><N><Q>@unheard-of /''ʌn''hə:dɔv/<br />*  tính từ<br />- chưa từng nghe thấy, chưa từng có<br />=an unheard-of act of bravery+ một hành động dũng cảm chưa từng có</Q></N></I></F></C>'),
(131100, 'unheart', '<C><F><I><N><Q>@unheart<br />* ngoại động từ<br />- làm thất vọng, làm chán nản, làm nản lòng; khiến cho phải rầu rĩ, khiến cho phải buồn chán, khiến cho phải u sầu</Q></N></I></F></C>'),
(131101, 'unheartsome', '<C><F><I><N><Q>@unheartsome<br />* tính từ<br />- (Xcôtlân) buồn rầu; không vui</Q></N></I></F></C>'),
(131102, 'unheated', '<C><F><I><N><Q>@unheated<br />* tính từ<br />- không được đun nóng, không được đốt nóng; không được sưởi ấm<br />- không (được) nấu, không (được) ninh, không (được) hầm<br />- không bị kích thích, không bị kích động, không bị xúc động</Q></N></I></F></C>'),
(131103, 'unhedged', '<C><F><I><N><Q>@unhedged<br />* tính từ<br />- không có rào, không có giậu<br />- không được bảo vệ</Q></N></I></F></C>'),
(131104, 'unheeded', '<C><F><I><N><Q>@unheeded /''ʌn''hi:did/<br />*  tính từ<br />- không ai chú ý đến, không ai để ý đến</Q></N></I></F></C>'),
(131105, 'unheedful', '<C><F><I><N><Q>@unheedful /''ʌn''hi:dful/<br />*  tính từ<br />- (+ of) không chú ý, không để ý (đến)</Q></N></I></F></C>'),
(131106, 'unheeding', '<C><F><I><N><Q>@unheeding /''ʌn''hi:diɳ/<br />*  tính từ<br />- (+ to) không chú ý (đến), không lo lắng (đến)</Q></N></I></F></C>'),
(131107, 'unheired', '<C><F><I><N><Q>@unheired<br />* tính từ<br />- (từ cổ, nghĩa cổ) không có người thừa kế, không có người thừa tự, không có người nối dõi; không có người kế tục, không có người kế thừa</Q></N></I></F></C>'),
(131108, 'unhele', '<C><F><I><N><Q>@unhele<br />* ngoại động từ<br />- (tiếng địa phương) phát hiện; phát giác; khám phá<br />- dỡ tranh, dỡ rạ (mái nhà)</Q></N></I></F></C>'),
(131109, 'unhelm', '<C><F><I><N><Q>@unhelm /''ʌn''helm/<br />*  ngoại động từ<br />- bỏ bánh lái (tàu) ra</Q></N></I></F></C>'),
(131110, 'unhelped', '<C><F><I><N><Q>@unhelped<br />* tính từ<br />- không được giúp đỡ, không được ủng hộ</Q></N></I></F></C>'),
