(131123, 'unhinge', '<C><F><I><N><Q>@unhinge /ʌn''hindʤ/<br />*  ngoại động từ<br />- nhấc (cửa) ra khỏi bản lề, tháo (cửa) ra<br />=to unhinge a door+ tháo cửa<br />- (thông tục) làm mất thăng bằng, làm cho mất phương hướng, làm cho rối (trí)<br />=his mind is unhinged+ đầu óc nó rối lên</Q></N></I></F></C>'),
(131124, 'unhinged', '<C><F><I><N><Q>@unhinge /ʌn''hindʤ/<br />*  ngoại động từ<br />- nhấc (cửa) ra khỏi bản lề, tháo (cửa) ra<br />=to unhinge a door+ tháo cửa<br />- (thông tục) làm mất thăng bằng, làm cho mất phương hướng, làm cho rối (trí)<br />=his mind is unhinged+ đầu óc nó rối lên</Q></N></I></F></C>'),
