(131180, 'uni-', '<C><F><I><N><Q>@uni-<br />- hình thái cấu tạo từ ghép<br />- đơn; một<br />= unicellular+đơn bào<br />- unicolour<br />- cùng một màu<br />- univalent<br />- đơn trị</Q></N></I></F></C>'),
(131181, 'Unianticipated inflation', '<C><F><I><N><Q>@Unianticipated inflation<br />- (Econ) Lạm phát không được lường trước.<br />+ Là phần lạm phát có thật mà con người không dự kiến; trong thức tế trừ đi lạm phát kỳ vọng.</Q></N></I></F></C>'),
(131182, 'uniat', '<C><F><I><N><Q>@uniat<br />* tính từ, cũng uniate<br />- thuộc về giáo hội ở Đông Âu hoặc vùng cận Đông, chấp nhận thẩm quyền của giáo hoàng nhưng vẫn giữ nghi thức tế tự của mình<br />* danh từ<br />- tín đồ của giáo hội này</Q></N></I></F></C>'),
(131183, 'uniaxial', '<C><F><I><N><Q>@uniaxial /''ju:ni''æksiəl/<br />*  tính từ<br />- có một trục<br /><br />@uniaxial<br />- đơn trục</Q></N></I></F></C>'),
