(131191, 'unicellularity', '<C><F><I><N><Q>@unicellularity<br />- xem unicellular</Q></N></I></F></C>'),
(131192, 'unicity', '<C><F><I><N><Q>@unicity<br />* danh từ<br />- tính chất độc nhất, tính chất đơn nhất, tính chất duy nhất<br />- tính chất hiếm có, tính chất hiếm hoi<br /><br />@unicity<br />- tính duy nhất</Q></N></I></F></C>'),
(131193, 'unicode', '<C><F><I><N><Q>@unicode<br />* danh từ<br />- bộ mã tiêu chuẩn quốc tế đa ngôn ngữ (tiêu chuẩn mã hoá ký tự 16 bit (do Unicode Consortium phát triển trong thời gian từ 1988 đến 1991) Do dùng hai byte thể hiện từng ký tự,  Unicode cho phép thể hiện hầu hết mọi ngôn ngữ viết trên thế giới bằng một tập ký tự đơn nhất)</Q></N></I></F></C>'),
