(131215, 'UNIDO guidelines', '<C><F><I><N><Q>@UNIDO guidelines<br />- (Econ) Các hướng dẫn của UNIDO.<br />+ Một kỹ thuật thẩm định dự án ở các nước đang phát triển và là một phiên bản của phương pháp LITTLE-MIRRLEES.</Q></N></I></F></C>'),
(131216, 'uniface', '<C><F><I><N><Q>@uniface<br />* tính từ<br />- có vẽ mặt người chỉ ở một phía (tiền; huân chương; giấy bạc...)</Q></N></I></F></C>'),
