(131221, 'unification', '<C><F><I><N><Q>@unification /,ju:nifi''keiʃn/<br />*  danh từ<br />- sự thống nhất, sự hợp nhất<br /><br />@unification<br />- sự thống nhất, sự hợp nhất</Q></N></I></F></C>'),
