(131230, 'unifoliate', '<C><F><I><N><Q>@unifoliate<br />* tính từ<br />- (thực vật học) một lá</Q></N></I></F></C>'),
(131231, 'uniforce', '<C><F><I><N><Q>@uniforce<br />* danh từ<br />- (quân sự) lực lượng vũ trang thống nhất của những nước đồng minh</Q></N></I></F></C>'),
(131232, 'uniform', '<C><F><I><N><Q>@uniform /''ju:nifɔ:m/<br />*  tính từ<br />- đồng dạng, cùng một kiểu, giống nhau<br />=of uniform length+ cùng một chiều dài như nhau<br />- không thay đổi, không biến hoá, đều<br />=to keep at a uniform temperature+ giữ ở một nhiệt độ không đổi<br />=uniform movement+ chuyển động đều<br />*  danh từ<br />- đồng phục; (quân) quân phục<br />*  ngoại động từ<br />- (quân sự) mặc quân phục<br /><br />@uniform<br />- đều</Q></N></I></F></C>'),
