(131236, 'uniformity', '<C><F><I><N><Q>@uniformity /,ju:ni''fɔ:miti/<br />*  danh từ<br />- tính giống nhau, tính đồng dạng<br />- tính chất (trạng thái) không thay đổi, tính đều đều, tính đơn điệu<br />=the uniformity of the movement+ tính chất đều của chuyển động<br /><br />@uniformity<br />- tính đều; tính đơn trị</Q></N></I></F></C>'),
(131237, 'uniformization', '<C><F><I><N><Q>@uniformization<br />- (giải tích) sự đơn trị hoá, sự làm đều<br />- u. of analytic function sự đơn trị hoá một hàm giải tích</Q></N></I></F></C>'),
