(131243, 'unify', '<C><F><I><N><Q>@unify /''ju:nifai/<br />*  ngoại động từ<br />- thống nhất, hợp nhất<br /><br />@unify<br />- hợp nhất, thống nhất</Q></N></I></F></C>'),
