(131260, 'unimaginativeness', '<C><F><I><N><Q>@unimaginativeness /''ʌni''mædʤinətivnis/<br />*  danh từ<br />- trí tưởng tượng nghèo nàn<br />- sự thiếu sáng kiến, tính không sáng tạo</Q></N></I></F></C>'),
(131261, 'unimagined', '<C><F><I><N><Q>@unimagined<br />* tính từ<br />- không phải tưởng tượng ra; không bày đặt; không bịa; có thật</Q></N></I></F></C>'),
