(131271, 'unimpeachableness', '<C><F><I><N><Q>@unimpeachableness /,ʌnim''pi:tʃəblnis/<br />*  danh từ<br />- tính không thể đặt thành vấn đề nghi ngờ, tính chắc chắn<br />- tính không thể bắt bẻ, tính không thể chê trách</Q></N></I></F></C>'),
(131272, 'unimpeachably', '<C><F><I><N><Q>@unimpeachably<br />* phó từ<br />- không thể nghi ngờ, không thể bắt bẻ, đáng tin cậy</Q></N></I></F></C>'),
(131273, 'unimpeached', '<C><F><I><N><Q>@unimpeached /''ʌnim''pi:tʃt/<br />*  tính từ<br />- không bị bắt bẻ, không bị chê trách</Q></N></I></F></C>'),
