(131281, 'unimpressible', '<C><F><I><N><Q>@unimpressible<br />* tính từ<br />- (văn học) không thể gây ấn tượng; không dễ cảm thụ<br />- không thể in, không thể khắc, không thể chạm</Q></N></I></F></C>'),
