(131348, 'unintended', '<C><F><I><N><Q>@unintended<br />* tính từ<br />- không được định hướng trước, không do dự tính trước</Q></N></I></F></C>'),
(131349, 'Unintended inventory disinvestment', '<C><F><I><N><Q>@Unintended inventory disinvestment<br />- (Econ) Giảm đầu tư vào tồn kho không dự kiến.<br />+ Giảm hàng tồn kho do mức bán hàng tăng lên không dự tính trước hay do giảm sút trong sản xuất.</Q></N></I></F></C>'),
(131350, 'Unintended inventory investment', '<C><F><I><N><Q>@Unintended inventory investment<br />- (Econ) Đầu tư vào tồn kho ngoài dự kiến.<br />+ Tăng hàng tồn kho do các đơn đặt hàng dự tính không thành hiện thực.</Q></N></I></F></C>'),
(131351, 'unintentional', '<C><F><I><N><Q>@unintentional /''ʌnin''tenʃənl/<br />*  tính từ<br />- không cố ý, không chủ tâm</Q></N></I></F></C>'),
(131352, 'unintentionally', '<C><F><I><N><Q>@unintentionally<br />- xem unintentional</Q></N></I></F></C>'),
(131353, 'uninterested', '<C><F><I><N><Q>@uninterested /''ʌn''intristid/<br />*  tính từ<br />- không quan tâm, không chú ý, không để ý<br />- vô tư, không cầu lợi</Q></N></I></F></C>'),
(131354, 'uninterestedly', '<C><F><I><N><Q>@uninterestedly<br />- xem uninterested</Q></N></I></F></C>'),
(131355, 'uninterestedness', '<C><F><I><N><Q>@uninterestedness<br />- xem uninterested</Q></N></I></F></C>'),
(131356, 'uninteresting', '<C><F><I><N><Q>@uninteresting /''ʌn''intristiɳ/<br />*  tính từ<br />- không hay, không thú vị; không đáng chú ý</Q></N></I></F></C>'),
(131357, 'uninterestingly', '<C><F><I><N><Q>@uninterestingly<br />- xem uninteresting</Q></N></I></F></C>'),
(131358, 'uninterestingness', '<C><F><I><N><Q>@uninterestingness /''ʌn''intristiɳnis/<br />*  danh từ<br />- tính chất không hay, tính chất không thú vị; tính chất không đáng chú ý</Q></N></I></F></C>'),
(131359, 'unintermitted', '<C><F><I><N><Q>@unintermitted<br />* tính từ<br />- không bị gián đoạn</Q></N></I></F></C>'),
(131360, 'unintermittent', '<C><F><I><N><Q>@unintermittent /''ʌn,intə''mitənt/<br />*  tính từ<br />- không ngừng, liên tục</Q></N></I></F></C>'),
(131361, 'unintermitting', '<C><F><I><N><Q>@unintermitting /''ʌn,intə''mitiɳ/<br />*  tính từ<br />- không đứt đoạn, không đứt quãng; liên tục</Q></N></I></F></C>'),
(131362, 'uninterpretable', '<C><F><I><N><Q>@uninterpretable /''ʌnintə:''pritəbl/<br />*  tính từ<br />- không thể giải thích được<br />- không thể dịch được</Q></N></I></F></C>'),
(131363, 'uninterpreted', '<C><F><I><N><Q>@uninterpreted<br />* tính từ<br />- không được lý giải, không được giải thích</Q></N></I></F></C>'),
(131364, 'uninterred', '<C><F><I><N><Q>@uninterred /''ʌnin''tə:d/<br />*  tính từ<br />- không được chôn cất, không được mai táng</Q></N></I></F></C>'),
(131365, 'uninterrupted', '<C><F><I><N><Q>@uninterrupted /''ʌn,intə''rʌptid/<br />*  tính từ<br />- không đứt quãng; liên tục</Q></N></I></F></C>'),
(131366, 'uninterruptible', '<C><F><I><N><Q>@uninterruptible<br />* tính từ<br />- không thể ngắt quãng<br />- không thể đứt quãng; liên tục</Q></N></I></F></C>'),
(131367, 'unintimidated', '<C><F><I><N><Q>@unintimidated<br />* tính từ<br />- không bị hăm doạ, không bị đe doạ, không bị doạ dẫm</Q></N></I></F></C>'),
(131368, 'unintoxicating', '<C><F><I><N><Q>@unintoxicating<br />* tính từ<br />- không làm say<br />= unintoxicating drinks+đồ uống không có chất rượu<br />- không kích thích, không kích động<br />- (y học) không làm nhiễm độc</Q></N></I></F></C>'),
(131369, 'uninuclear', '<C><F><I><N><Q>@uninuclear /''ju:ni''nju:kliə/<br />*  tính từ<br />- đơn nhân (tế bào)</Q></N></I></F></C>'),
(131370, 'uninucleate', '<C><F><I><N><Q>@uninucleate<br />- xem uninuclear</Q></N></I></F></C>'),
(131371, 'uninvaded', '<C><F><I><N><Q>@uninvaded<br />* tính từ<br />- không bị xâm lược, không bị chiếm đóng</Q></N></I></F></C>'),
(131372, 'uninventive', '<C><F><I><N><Q>@uninventive /''ʌnin''ventiv/<br />*  tính từ<br />- không có tài phát minh, không có tài sáng chế; không có óc sáng tạo</Q></N></I></F></C>'),
(131373, 'uninvested', '<C><F><I><N><Q>@uninvested<br />* tính từ<br />- không được đầu tư, không được cấp vốn</Q></N></I></F></C>'),
(131374, 'uninvestigated', '<C><F><I><N><Q>@uninvestigated /''ʌnin''vestigeitid/<br />*  tính từ<br />- không điều tra nghiên cứu</Q></N></I></F></C>'),
(131375, 'uninvited', '<C><F><I><N><Q>@uninvited /''ʌnin''vaitid/<br />*  tính từ<br />- không được mời</Q></N></I></F></C>'),
(131376, 'uninviting', '<C><F><I><N><Q>@uninviting /''ʌnin''vaitiɳ/<br />*  tính từ<br />- không hấp dẫn, không lôi cuốn; không ngon (món ăn)</Q></N></I></F></C>'),
(131377, 'uninvitingly', '<C><F><I><N><Q>@uninvitingly<br />- xem uninviting</Q></N></I></F></C>'),
(131378, 'uninvoked', '<C><F><I><N><Q>@uninvoked<br />* tính từ<br />- không được dẫn chứng<br />- không được gọi về (thần, quỷ ma)<br />- không được cầu khấn</Q></N></I></F></C>'),
(131379, 'uninvolved', '<C><F><I><N><Q>@uninvolved /''ʌnin''vɔlvd/<br />*  tính từ<br />- không gồm, không bao hàm</Q></N></I></F></C>'),
(131380, 'Union', '<C><F><I><N><Q>@Union/non-union differential<br />- (Econ) Chênh lệch tiền lương giữa công nhân tham gia và không tham gia công đoàn.<br />+ Chênh lệch này đo mức độ mà các công đoàn đã tăng tiền lương của thành viên so với lao đông không tham gia công đoàn tương đương.</Q></N></I></F></C>'),
(131381, 'union', '<C><F><I><N><Q>@union /''ju:njən/<br />*  danh từ<br />- sự hợp nhất, sự kết hợp, sự liên kết; liên minh, liên hiệp<br />=the union of several co-operatives+ sự hợp nhất của nhiều hợp tác xã<br />=a union by treaty+ sự liên kết bằng hiệp ước<br />- sự nhất trí, sự cộng đồng, sự đoàn kết, sự hoà hợp<br />=union is strength+ đoàn kết là sức mạnh<br />=the union of the nation+ sự đoàn kết của dân tộc<br />- hiệp hội, liên hiệp; đồng minh; liên bang<br />=the Soviet Union+ Liên bang Xô-viết<br />=the Union+ nước Mỹ<br />- sự kết hôn, hôn nhân<br />=a happy union+ một cuộc hôn nhân hạnh phúc<br />- nhà tế bần<br />=to go into the union (Union-house)+ ra ở nhà tế bần<br />- (the Union) câu lạc bộ và hội tranh luận (ở một vài trường đại học); trụ sở của hội tranh luận<br />- thùng (để) lắng bia<br />- vải sợi pha lanh; vải sợi pha tơ<br />- (kỹ thuật) Răcco, ống nối<br /><br />@union<br />- hợp<br />- u. of sets hợp nhất của các tập hợp <br />- u. of spheres (tô pô) bó hình cầu <br />- direct u. (đại số) hợp trực tiếp</Q></N></I></F></C>'),
(131382, 'Union density', '<C><F><I><N><Q>@Union density<br />- (Econ) Tỷ lệ tham gia công đoàn.<br />+ Tỷ lệ lực lượng lao động tham gia công đoàn thay đổi mạnh giữa những các nghành và giữa các nước do khác biệt trong chi phí và lợi ích của việc tham gia công đoàn.</Q></N></I></F></C>'),
(131383, 'Union distribution', '<C><F><I><N><Q>@Union distribution<br />- (Econ) Phân phối đều.</Q></N></I></F></C>'),
(131384, 'Union market power', '<C><F><I><N><Q>@Union market power<br />- (Econ) Sức mạnh của công đoàn đối với thị trường.<br />+ Sức mạnh của công đoàn đối với thị trường là một hàm của độ co giãn của cầu phát sinh đối với lao động công đoàn.</Q></N></I></F></C>'),
(131385, 'Union pushfulness', '<C><F><I><N><Q>@Union pushfulness<br />- (Econ) Tính thích tranh đấu của công đoàn.<br />+ Xu hướng của các công đoàn tham gia đòi tăng lương, nghĩa là tâm trạng thích hành động tranh đấu.</Q></N></I></F></C>'),
(131386, 'Union shop', '<C><F><I><N><Q>@Union shop<br />- (Econ) quầy trói buộc<br />+ Một thoả thuận theo đó người công nhân phải tham gia công đoàn trong một thời kỳ đã định sau khi bắt đầu làm việc.</Q></N></I></F></C>'),
(131387, 'union suit', '<C><F><I><N><Q>@union suit /''ju:njən''sju:t/<br />*  danh từ<br />- (từ Mỹ,nghĩa Mỹ) bộ quần áo vệ sinh may liền</Q></N></I></F></C>'),
(131388, 'unionalls', '<C><F><I><N><Q>@unionalls<br />* danh từ số nhiều<br />- áo liền quần, quần áo lao động</Q></N></I></F></C>'),
(131389, 'unionisation', '<C><F><I><N><Q>@unionisation<br />* danh từ<br />- sự tổ chức thành công đoàn</Q></N></I></F></C>'),
(131390, 'unionise', '<C><F><I><N><Q>@unionise /''ju:njənaiz/ (unionise) /''ju:njənaiz/<br />*  ngoại động từ<br />- tổ chức thành công đoàn (nghiệp đoàn)</Q></N></I></F></C>'),
(131391, 'unionism', '<C><F><I><N><Q>@unionism /''ju:njənizm/<br />*  danh từ<br />- chủ nghĩa công đoàn, chủ nghĩa nghiệp đoàn<br />- chủ nghĩa hợp nhất (ở Mỹ trong thời kỳ chiến tranh Nam Bắc)</Q></N></I></F></C>'),
(131392, 'unionist', '<C><F><I><N><Q>@unionist /''ju:njənist/<br />*  danh từ<br />- đoàn viên công đoàn, đoàn viên nghiệp đoàn<br />- (Unionist) đảng viên đảng Hợp nhất (Anh,  Mỹ)</Q></N></I></F></C>'),
(131393, 'unionistic', '<C><F><I><N><Q>@unionistic<br />- xem unionist</Q></N></I></F></C>'),
(131394, 'unionists', '<C><F><I><N><Q>@unionist /''ju:njənist/<br />*  danh từ<br />- đoàn viên công đoàn, đoàn viên nghiệp đoàn<br />- (Unionist) đảng viên đảng Hợp nhất (Anh,  Mỹ)</Q></N></I></F></C>'),
(131395, 'unionization', '<C><F><I><N><Q>@unionization<br />* danh từ<br />- sự tổ chức thành công đoàn</Q></N></I></F></C>'),
(131396, 'unionizations', '<C><F><I><N><Q>@unionization<br />* danh từ<br />- sự tổ chức thành công đoàn</Q></N></I></F></C>'),
(131397, 'unionize', '<C><F><I><N><Q>@unionize /''ju:njənaiz/ (unionise) /''ju:njənaiz/<br />*  ngoại động từ<br />- tổ chức thành công đoàn (nghiệp đoàn)</Q></N></I></F></C>'),
(131398, 'unionized', '<C><F><I><N><Q>@unionize /''ju:njənaiz/ (unionise) /''ju:njənaiz/<br />*  ngoại động từ<br />- tổ chức thành công đoàn (nghiệp đoàn)</Q></N></I></F></C>'),
(131399, 'unionizer', '<C><F><I><N><Q>@unionizer<br />- xem unionize</Q></N></I></F></C>'),
(131400, 'unionizes', '<C><F><I><N><Q>@unionize /''ju:njənaiz/ (unionise) /''ju:njənaiz/<br />*  ngoại động từ<br />- tổ chức thành công đoàn (nghiệp đoàn)</Q></N></I></F></C>'),
(131401, 'unionizing', '<C><F><I><N><Q>@unionize /''ju:njənaiz/ (unionise) /''ju:njənaiz/<br />*  ngoại động từ<br />- tổ chức thành công đoàn (nghiệp đoàn)</Q></N></I></F></C>'),
(131402, 'unions', '<C><F><I><N><Q>@Union/non-union differential<br />- (Econ) Chênh lệch tiền lương giữa công nhân tham gia và không tham gia công đoàn.<br />+ Chênh lệch này đo mức độ mà các công đoàn đã tăng tiền lương của thành viên so với lao đông không tham gia công đoàn tương đương.</Q></N></I></F></C><C><F><I><N><Q>@union /''ju:njən/<br />*  danh từ<br />- sự hợp nhất, sự kết hợp, sự liên kết; liên minh, liên hiệp<br />=the union of several co-operatives+ sự hợp nhất của nhiều hợp tác xã<br />=a union by treaty+ sự liên kết bằng hiệp ước<br />- sự nhất trí, sự cộng đồng, sự đoàn kết, sự hoà hợp<br />=union is strength+ đoàn kết là sức mạnh<br />=the union of the nation+ sự đoàn kết của dân tộc<br />- hiệp hội, liên hiệp; đồng minh; liên bang<br />=the Soviet Union+ Liên bang Xô-viết<br />=the Union+ nước Mỹ<br />- sự kết hôn, hôn nhân<br />=a happy union+ một cuộc hôn nhân hạnh phúc<br />- nhà tế bần<br />=to go into the union (Union-house)+ ra ở nhà tế bần<br />- (the Union) câu lạc bộ và hội tranh luận (ở một vài trường đại học); trụ sở của hội tranh luận<br />- thùng (để) lắng bia<br />- vải sợi pha lanh; vải sợi pha tơ<br />- (kỹ thuật) Răcco, ống nối<br /><br />@union<br />- hợp<br />- u. of sets hợp nhất của các tập hợp <br />- u. of spheres (tô pô) bó hình cầu <br />- direct u. (đại số) hợp trực tiếp</Q></N></I></F></C>'),
(131403, 'uniparous', '<C><F><I><N><Q>@uniparous /ju:''nipərəs/<br />*  tính từ<br />- (động vật học) chỉ đẻ một con</Q></N></I></F></C>'),
(131404, 'uniplanar', '<C><F><I><N><Q>@uniplanar<br />* tính từ<br />- nằm trên cùng một mặt phẳng, đơn diện</Q></N></I></F></C>'),
(131405, 'unipolar', '<C><F><I><N><Q>@unipolar<br />* tính từ<br />- một cực, đơn cực</Q></N></I></F></C>'),
(131406, 'unipotent', '<C><F><I><N><Q>@unipotent<br />- luỹ đơn</Q></N></I></F></C>'),
(131407, 'unique', '<C><F><I><N><Q>@unique /ju:''ni:k/<br />*  tính từ<br />- chỉ có một, duy nhất, đơn nhất, vô song<br />=unique meaning+ nghĩa duy nhất<br />=unique aim+ mục đích duy nhất<br />=unique son+ con một<br />- (thông tục) kỳ cục, lạ đời, dị thường<br />=you are unique+ anh kỳ thật, anh lạ đời thật<br />*  danh từ<br />- vật duy nhất, vật chỉ có một không hai<br /><br />@unique<br />- duy nhất, đơn trị</Q></N></I></F></C>'),
(131408, 'uniquely', '<C><F><I><N><Q>@uniquely<br />* tính từ<br />- đơn nhất; độc nhất vô nhị, chỉ có một<br />- duy nhất, vô song (không có cái gì giống hoặc bằng)<br />- chỉ liên quan đến một người (một nhóm, một vật)<br />- &lt;thgt&gt; khác thường, đáng chú ý, kỳ cục, lạ đời, dị thường</Q></N></I></F></C>'),
(131409, 'Uniqueness', '<C><F><I><N><Q>@Uniqueness<br />- (Econ) Tính độc nhất.<br />+ Nói chung được dùng trong thuyết cân bằng tổng quát để chỉ sự tồn tại của một bộ giá cân bằng thị trường độc nhất.</Q></N></I></F></C>'),
(131410, 'uniqueness', '<C><F><I><N><Q>@uniqueness<br />- xem unique<br /><br />@uniqueness<br />- tính duy nhất; tính đơn trị<br />- u. of solution tính duy nhất của nghiệm</Q></N></I></F></C>'),
(131411, 'unirational', '<C><F><I><N><Q>@unirational<br />- hh; (đại số) đơn hữu tỷ</Q></N></I></F></C>'),
(131412, 'unironed', '<C><F><I><N><Q>@unironed<br />* tính từ<br />- không bị cùm, không bị xích<br />- không được ủi, không được vuốt phẳng</Q></N></I></F></C>'),
(131413, 'unironically', '<C><F><I><N><Q>@unironically<br />- trạng từ<br />- một cách không mỉa mai</Q></N></I></F></C>'),
(131414, 'unirradiated', '<C><F><I><N><Q>@unirradiated<br />* tính từ<br />- không có ánh sáng chiếu/rọi vào<br />- không được soi sáng</Q></N></I></F></C>'),
(131415, 'unirrigated', '<C><F><I><N><Q>@unirrigated /''ʌn''irigeitid/<br />*  tính từ<br />- không tưới (ruộng đất)</Q></N></I></F></C>');
INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(131416, 'unirritating', '<C><F><I><N><Q>@unirritating<br />* tính từ<br />- không chọc tức, không trêu gan</Q></N></I></F></C>'),
(131417, 'uniselector', '<C><F><I><N><Q>@uniselector<br />- (máy tính) bộ tìm xoay tròn, bộ chọn đơn</Q></N></I></F></C>'),
(131418, 'uniserial', '<C><F><I><N><Q>@uniserial /''ju:ni''siəriəl/ (uniseriate) /''ju:nii''siəriit/<br />*  tính từ<br />- một dãy<br /><br />@uniserial<br />- (đại số) một chuỗi</Q></N></I></F></C>'),
(131419, 'uniseriate', '<C><F><I><N><Q>@uniseriate /''ju:ni''siəriəl/ (uniseriate) /''ju:nii''siəriit/<br />*  tính từ<br />- một dãy</Q></N></I></F></C>'),
(131420, 'unisex', '<C><F><I><N><Q>@unisex<br />* tính từ<br />- cả nam lẫn nữ, phù hợp cho cả hai giới (về phong cách, chức năng)</Q></N></I></F></C>'),
(131421, 'unisexed', '<C><F><I><N><Q>@unisexed /''ju:ni''sekst/ (unisexual) /''ju:ni''seksjuəl/<br />*  tính từ<br />- (thực vật học) đơn tính</Q></N></I></F></C>'),
(131422, 'unisexual', '<C><F><I><N><Q>@unisexual /''ju:ni''sekst/ (unisexual) /''ju:ni''seksjuəl/<br />*  tính từ<br />- (thực vật học) đơn tính</Q></N></I></F></C>'),
(131423, 'unisexuality', '<C><F><I><N><Q>@unisexuality /''ju:ni,seksju''æliti/<br />*  danh từ<br />- tính chất đơn tính</Q></N></I></F></C>'),
(131424, 'unisexually', '<C><F><I><N><Q>@unisexually<br />- xem unisexual</Q></N></I></F></C>'),
(131425, 'unisolated', '<C><F><I><N><Q>@unisolated /''ʌn''aisəleitid/<br />*  tính từ<br />- không cô lập<br />- (y học) không cách ly<br />- (điện học) không cách điện<br />- (hoá học) không tách ra</Q></N></I></F></C>'),
(131426, 'unison', '<C><F><I><N><Q>@unison /''ju:nizn/<br />*  danh từ<br />- (âm nhạc) trạng thái đồng âm<br />=to sing in unison+ hợp xướng<br />- trạng thái nhất trí, trạng thái hoà hợp<br />=to act in perfect unison with others+ hành động nhất trí hoàn toàn với những người khác</Q></N></I></F></C>'),
(131427, 'unisons', '<C><F><I><N><Q>@unison /''ju:nizn/<br />*  danh từ<br />- (âm nhạc) trạng thái đồng âm<br />=to sing in unison+ hợp xướng<br />- trạng thái nhất trí, trạng thái hoà hợp<br />=to act in perfect unison with others+ hành động nhất trí hoàn toàn với những người khác</Q></N></I></F></C>'),
(131428, 'unissued', '<C><F><I><N><Q>@unissued /''ʌn''isju:d/<br />*  tính từ<br />- không đưa ra, không phát hành, không in ra</Q></N></I></F></C>'),
(131429, 'unit', '<C><F><I><N><Q>@unit /''ju:nit/<br />*  danh từ<br />- một, một cái<br />- đơn vị<br />=a unit of length+ đơn vị đo chiều dài<br />=a unit of weight+ đơn vị trọng lượng<br />=a monetary unit+ đơn vị tiền tệ<br />=magnetic unit+ đơn vị từ<br />=a combat unit+ đơn vị chiến đấu<br /><br />@unit<br />- đơn vị<br />- u. of a group đơn vị của một nhóm <br />- absolute u. (vật lí) đơn vị tuyệt đối <br />- arithmetic u. (máy tính) đơn vị số học, bộ số học <br />- calibrator u. bộ định cỡ, bộ định các hệ số <br />- computing u. (thống kê) đơn vị tính toán, đơn vị tỷ lệ <br />- defective u. (thống kê) đơn vị khuyết tật, đơn vị phế phẩm <br />- dimensional u. đơn vị thứ nguyên <br />- driver u. đơn vị điều khiển <br />- elementary u. khối sơ cấp<br />- flexible u. (máy tính) đơn vị vạn năng <br />- function u. (máy tính) đơn vị hàm <br />- fundamental u. đơn vị cơ bản <br />- hysteresis u. đơn vị trễ <br />- imaginary u. đơn vị ảo <br />- input-output u. đơn vị vào _ ra <br />- matrix u. (đại số) ma trận đơn vị<br />- middle u. (đại số) đơn vị giữa<br />- multiplication - division u. (máy tính) đơn vị nhân - chia <br />- multiplying u. đơn vị nhân<br />- primary u. phần tử sơ cấp <br />- sample u. đơn vị mẫu <br />- sampling u. đơn vị mẫu <br />- secondary u. đơn vị thứ cấp (của giai đoạn lấy mẫu thứ hai)<br />- spare u. (máy tính) đơn vị dự trữ <br />- strong u. đơn vị mạnh<br />- translator u. đơn vị dịch<br />- weak u. đơn vị yếu</Q></N></I></F></C>'),
(131430, 'Unit of account', '<C><F><I><N><Q>@Unit of account<br />- (Econ) Đơn vị kế toán.<br />+ Xem Money.</Q></N></I></F></C>'),
(131431, 'unit price', '<C><F><I><N><Q>@unit price<br />* danh từ<br />- giá đơn vị (giá của mỗi đơn vì hàng hoá cùng một loại)</Q></N></I></F></C>'),
(131432, 'Unit root tests', '<C><F><I><N><Q>@Unit root tests<br />- (Econ) Kiểm định đơn vị.<br />+ Phép kiểm định để xác định xem liệu một chuỗi thời gian là tĩnh tại về chênh lệch hay không.</Q></N></I></F></C>'),
(131433, 'Unit tax', '<C><F><I><N><Q>@Unit tax<br />- (Econ) Thuế đơn vị.<br />+ Xem CUSTOMS, EXCISE AND PROTECTIVE DUTIES.</Q></N></I></F></C>'),
(131434, 'Unit Trust', '<C><F><I><N><Q>@Unit Trust<br />- (Econ) Độc quyền đơn vị.<br />+ Một cụm thuật ngữ dùng ở Anh để chỉ một thể chế, giống như một độc quyền đầu tư, mà tạo điều kiện cho các nhà đầu tư phân tán rủi ro bằng việc mua cổ phần trong một danh mục chứng khoán.</Q></N></I></F></C>'),
(131435, 'unit trust', '<C><F><I><N><Q>@unit trust<br />* danh từ<br />- công ty đầu tư tín thác (công ty đầu tư, sử dụng các đóng góp của các thành viên đầu tư vào các chứng khoán khác nhau và trả tiền lãi cho các thành viên theo tỷ lệ cổ phần của họ tính theo trung bình có được từ các chứng khoán đó)</Q></N></I></F></C>'),
(131436, 'unitable', '<C><F><I><N><Q>@unitable<br />* tính từ<br />- có thể gộp lại, có thể kết hợp lại</Q></N></I></F></C>'),
(131437, 'unitarian', '<C><F><I><N><Q>@unitarian /,ju:ni''teəriən/<br />*  tính từ<br />- (tôn giáo) (Unitarian) người theo thuyết nhất thể<br />- người tán thành sự tập trung về chính trị</Q></N></I></F></C>'),
(131438, 'unitarianism', '<C><F><I><N><Q>@unitarianism /,ju:ni''teəriənizm/<br />*  danh từ<br />- (tôn giáo) thuyết nhất thể</Q></N></I></F></C>'),
(131439, 'Unitarians', '<C><F><I><N><Q>@unitarian /,ju:ni''teəriən/<br />*  tính từ<br />- (tôn giáo) (Unitarian) người theo thuyết nhất thể<br />- người tán thành sự tập trung về chính trị</Q></N></I></F></C>'),
(131440, 'unitary', '<C><F><I><N><Q>@unitary<br />* tính từ<br />- đơn nhất, nguyên khối, nhất thể<br />- thuộc về đơn vị<br /><br />@unitary<br />- unita, đơn nguyên đơn vị</Q></N></I></F></C>'),
(131441, 'unitcircle', '<C><F><I><N><Q>@unitcircle<br />- (giải tích) vòng tròn đơn vị</Q></N></I></F></C>'),
(131442, 'unite', '<C><F><I><N><Q>@unite /ju:''nait/<br />*  động từ<br />- nối, hợp làm một, hợp nhất, kết lại<br />=to unite one town with another+ hợp nhất hai thành phố<br />=to unite bricks with cement+ kết những viên gạch lại bằng xi măng<br />- liên kết, liên hiệp, đoàn kết<br />=workers of the world, unite!+ vô sản toàn thế giới, liên hiệp lại!<br />=les us unite to fight our common enemy+ chúng ta hãy đoàn kết lại để chiến đấu chống kẻ thù chung<br />- kết thân, kết hôn<br />- hoà hợp<br /><br />@unite<br />- hợp nhất</Q></N></I></F></C>'),
(131443, 'united', '<C><F><I><N><Q>@united /ju:''naitid/<br />*  tính từ<br />- hợp, liên liên kết<br />=the United States of America+ Hoa kỳ,  Mỹ<br />=the United Nations Organization+ Liên hiệp quốc<br />- đoàn kết, hoà hợp<br />=united we stand, divided we fall+ đoàn kết thì đứng vững, chia rẽ thì đổ<br />=a united family+ một gia đình hoà hợp</Q></N></I></F></C><C><F><I><N><Q>@unite /ju:''nait/<br />*  động từ<br />- nối, hợp làm một, hợp nhất, kết lại<br />=to unite one town with another+ hợp nhất hai thành phố<br />=to unite bricks with cement+ kết những viên gạch lại bằng xi măng<br />- liên kết, liên hiệp, đoàn kết<br />=workers of the world, unite!+ vô sản toàn thế giới, liên hiệp lại!<br />=les us unite to fight our common enemy+ chúng ta hãy đoàn kết lại để chiến đấu chống kẻ thù chung<br />- kết thân, kết hôn<br />- hoà hợp<br /><br />@unite<br />- hợp nhất</Q></N></I></F></C>'),
(131444, 'united kingdom', '<C><F><I><N><Q>@united kingdom<br />* danh từ<br />- (the United Kingdom)  &lt;vt&gt; UK Vương quốc Liên hiệp Anh (nhất là khi đề địa chỉ; gồm nước Anh và Bắc Ireland)</Q></N></I></F></C>'),
(131445, 'United Nationns Development Programme (UNDP)', '<C><F><I><N><Q>@United Nationns Development Programme (UNDP)<br />- (Econ) Chương trình phát triển của Liên hợp quốc.<br />+ Năm 1966, chương trình Hỗ trợ tài chính mở rộng của Liên hợp quốc và quỹ đặc biệt của Liên hợp quốc được sáp nhập tạo nên chương trình phát triển của liên hợp quốc, cơ quan đặc biệt của Liên hợp quốc chịu trách nhiệm quản lý và điều phối các dự án phát triển và hỗ trợ kỹ thuất được cung cấp dưới sự bảo trợ hay liên lạc với hệ thống các cơ quan phát triển của Liên hợp quốc.</Q></N></I></F></C>'),
(131446, 'United Nationns Industrial Development Organization (UNIDO)', '<C><F><I><N><Q>@United Nationns Industrial Development Organization (UNIDO)<br />- (Econ) Tổ chức phát triển công nghiệp của Liên hợp quốc.<br />+ Được thành lập vào năm 1966, là một cơ quan đặc biệt của Liên hợp quốc sau nghị quyết của hội đồng bảo an, tổ chức này cung cấp hỗ trợ kỹ thuật nhằm thúc đẩy công nghiệp hoá ở các nước đang phát triển.</Q></N></I></F></C>'),
(131447, 'united nations', '<C><F><I><N><Q>@united nations<br />* danh từ<br />- (the United Nations)  &lt;vt&gt; UN Liên hiệp quốc</Q></N></I></F></C>'),
(131448, 'United Nations Capital Development Fund', '<C><F><I><N><Q>@United Nations Capital Development Fund<br />- (Econ) Quỹ phát triển vốn của Liên hợp quốc.<br />+ Một cơ quan đặc biệt được hội đồng bảo an Liên hợp quốc thành lập năm 1966 để thúc đẩy tăng trương kinh tế ở các nước đang phát triển bằng việc bổ sung các nguồn hỗ trợ vốn hiện có với các khoản cho vay và viện trợ; chủ yếu để tài trợ các dự án phát triển nông thôn quy mô nhỏ mà không thể có được nguồn tài chính nào khác do không có đủ tài sản thế chấp hay không có uy tín tín dụng đối với bên vay.</Q></N></I></F></C>'),
(131449, 'United Nations Conference on Trade and Development (UNCTAD)', '<C><F><I><N><Q>@United Nations Conference on Trade and Development (UNCTAD)<br />- (Econ) Hội nghị Liên hiệp quốc về Thương mại và Phát triển.<br />+ Hội nghị được triệu tập lần đầu tiên vào năm 1964, hiện nay là một bộ phận vĩnh cửu của Đại hội đồng bảo an và sau đó đã họp vào năm 1968. 1972, 1976, 1979, 1983 và 1987. Tất cả các thành viên của liên hợp quốc hay của các cơ quan chuyên môn của họ là thành viên của hội nghị và nó có một ban chấp hành và một ban thư ký vĩnh viễn.</Q></N></I></F></C>'),
(131450, 'united states', '<C><F><I><N><Q>@united states<br />* danh từ<br />- (the United States (of American))  &lt;vt&gt; US, USA Hoa kỳ, Mỹ</Q></N></I></F></C>'),
(131451, 'unitedly', '<C><F><I><N><Q>@unitedly /ju:''naitidli/<br />*  phó từ<br />- cùng nhau, cùng chung sức, cộng đồng, kết hợp, đoàn kết lại</Q></N></I></F></C>'),
(131452, 'unitedness', '<C><F><I><N><Q>@unitedness<br />- xem united</Q></N></I></F></C>'),
(131453, 'unites', '<C><F><I><N><Q>@unite /ju:''nait/<br />*  động từ<br />- nối, hợp làm một, hợp nhất, kết lại<br />=to unite one town with another+ hợp nhất hai thành phố<br />=to unite bricks with cement+ kết những viên gạch lại bằng xi măng<br />- liên kết, liên hiệp, đoàn kết<br />=workers of the world, unite!+ vô sản toàn thế giới, liên hiệp lại!<br />=les us unite to fight our common enemy+ chúng ta hãy đoàn kết lại để chiến đấu chống kẻ thù chung<br />- kết thân, kết hôn<br />- hoà hợp<br /><br />@unite<br />- hợp nhất</Q></N></I></F></C>'),
(131454, 'unities', '<C><F><I><N><Q>@unity /''ju:niti/<br />*  danh từ<br />- tính đơn nhất, tính thuần nhất, tính duy nhất, tính đồng nhất<br />=the unity of the painting+ tính đồng nhất của bức tranh<br />- sự thống nhất<br />=national unity+ sự thống nhất quốc gia<br />- sự đoàn kết, sự hoà hợp, sự hoà thuận<br />- (toán học) đơn vị<br /><br />@unity<br />- phần tử đơn vị; sự thống nhất; duy nhất</Q></N></I></F></C>'),
(131455, 'uniting', '<C><F><I><N><Q>@unite /ju:''nait/<br />*  động từ<br />- nối, hợp làm một, hợp nhất, kết lại<br />=to unite one town with another+ hợp nhất hai thành phố<br />=to unite bricks with cement+ kết những viên gạch lại bằng xi măng<br />- liên kết, liên hiệp, đoàn kết<br />=workers of the world, unite!+ vô sản toàn thế giới, liên hiệp lại!<br />=les us unite to fight our common enemy+ chúng ta hãy đoàn kết lại để chiến đấu chống kẻ thù chung<br />- kết thân, kết hôn<br />- hoà hợp<br /><br />@unite<br />- hợp nhất</Q></N></I></F></C>'),
(131456, 'unitive', '<C><F><I><N><Q>@unitive<br />* tính từ<br />- có sức đoàn kết, có khuynh hướng hợp nhất, có khuynh hướng thống nhất</Q></N></I></F></C>'),
(131457, 'units', '<C><F><I><N><Q>@unit /''ju:nit/<br />*  danh từ<br />- một, một cái<br />- đơn vị<br />=a unit of length+ đơn vị đo chiều dài<br />=a unit of weight+ đơn vị trọng lượng<br />=a monetary unit+ đơn vị tiền tệ<br />=magnetic unit+ đơn vị từ<br />=a combat unit+ đơn vị chiến đấu<br /><br />@unit<br />- đơn vị<br />- u. of a group đơn vị của một nhóm <br />- absolute u. (vật lí) đơn vị tuyệt đối <br />- arithmetic u. (máy tính) đơn vị số học, bộ số học <br />- calibrator u. bộ định cỡ, bộ định các hệ số <br />- computing u. (thống kê) đơn vị tính toán, đơn vị tỷ lệ <br />- defective u. (thống kê) đơn vị khuyết tật, đơn vị phế phẩm <br />- dimensional u. đơn vị thứ nguyên <br />- driver u. đơn vị điều khiển <br />- elementary u. khối sơ cấp<br />- flexible u. (máy tính) đơn vị vạn năng <br />- function u. (máy tính) đơn vị hàm <br />- fundamental u. đơn vị cơ bản <br />- hysteresis u. đơn vị trễ <br />- imaginary u. đơn vị ảo <br />- input-output u. đơn vị vào _ ra <br />- matrix u. (đại số) ma trận đơn vị<br />- middle u. (đại số) đơn vị giữa<br />- multiplication - division u. (máy tính) đơn vị nhân - chia <br />- multiplying u. đơn vị nhân<br />- primary u. phần tử sơ cấp <br />- sample u. đơn vị mẫu <br />- sampling u. đơn vị mẫu <br />- secondary u. đơn vị thứ cấp (của giai đoạn lấy mẫu thứ hai)<br />- spare u. (máy tính) đơn vị dự trữ <br />- strong u. đơn vị mạnh<br />- translator u. đơn vị dịch<br />- weak u. đơn vị yếu</Q></N></I></F></C>'),
(131458, 'unity', '<C><F><I><N><Q>@unity /''ju:niti/<br />*  danh từ<br />- tính đơn nhất, tính thuần nhất, tính duy nhất, tính đồng nhất<br />=the unity of the painting+ tính đồng nhất của bức tranh<br />- sự thống nhất<br />=national unity+ sự thống nhất quốc gia<br />- sự đoàn kết, sự hoà hợp, sự hoà thuận<br />- (toán học) đơn vị<br /><br />@unity<br />- phần tử đơn vị; sự thống nhất; duy nhất</Q></N></I></F></C>'),
(131459, 'univ', '<C><F><I><N><Q>@univ<br />* (viết tắt)<br />- trường đại học (University)</Q></N></I></F></C>'),
(131460, 'univalence', '<C><F><I><N><Q>@univalence<br />* danh từ<br />- tính đơn trị<br /><br />@univalence<br />- (giải tích) đơn diệp, đơn giá<br />- locally u. (giải tích) đơn diệp địa phương</Q></N></I></F></C>'),
(131461, 'univalent', '<C><F><I><N><Q>@univalent /,ju:ni''veilənt/<br />*  tính từ<br />- (hoá học) có hoá trị một</Q></N></I></F></C>'),
(131462, 'univalve', '<C><F><I><N><Q>@univalve<br />* tính từ<br />- một van, một mảnh vỡ, một nắp</Q></N></I></F></C>'),
(131463, 'univalves', '<C><F><I><N><Q>@univalve<br />* tính từ<br />- một van, một mảnh vỡ, một nắp</Q></N></I></F></C>'),
