(131600, 'Unlisted Securities Market (USM)', '<C><F><I><N><Q>@Unlisted Securities Market (USM)<br />- (Econ) Thị trường chứng khoán không niêm yết.<br />+ Do sở giao dịch chứng khoán London (là cơ quan quản lý) thành lập năm 1980, USM là một thị trường ít tổ chức hơn so với sở giao dịch chứng khoán.</Q></N></I></F></C>'),
