(131650, 'unmaidenly', '<C><F><I><N><Q>@unmaidenly /''ʌn''meidnli/<br />*  tính từ<br />- không xứng đáng là một cô gái, không phù hợp với một cô gái; không dịu dàng</Q></N></I></F></C>'),
(131651, 'unmailable', '<C><F><I><N><Q>@unmailable /''ʌn''meiləbl/<br />*  tính từ<br />- không thể gửi qua bưu điện, không được gửi qua bưu điện</Q></N></I></F></C>'),
(131652, 'unmailed', '<C><F><I><N><Q>@unmailed<br />* tính từ<br />- không qua bưu điện, không nhận từ bưu điện</Q></N></I></F></C>'),
(131653, 'unmaimed', '<C><F><I><N><Q>@unmaimed /''ʌn''meimd/<br />*  tính từ<br />- không bị thương tật, không bị tàn tật<br />- không bị cắt xén (một quyển sách, một đoạn văn...)</Q></N></I></F></C>'),
