(131657, 'unmaking', '<C><F><I><N><Q>@unmake /''ʌn''meik/<br />*  ngoại động từ unmade<br />- phá đi; phá huỷ</Q></N></I></F></C>'),
(131658, 'unmalicious', '<C><F><I><N><Q>@unmalicious<br />* tính từ<br />- không hiểm độc, không độc ác, không tàn nhẫn</Q></N></I></F></C>'),
(131659, 'unmaliness', '<C><F><I><N><Q>@unmaliness /''ʌn''mænlinis/<br />*  danh từ<br />- sự thiếu đức tính đàn ông, sự không xứng đáng là kẻ nam nhi; sự không dũng mãnh, sự không hùng dũng; tính yếu đuối, tính nhu nhược<br />- tính tầm thường, tính hèn yếu</Q></N></I></F></C>'),
(131660, 'unmalleability', '<C><F><I><N><Q>@unmalleability /''ʌn,mæliə''biliti/<br />*  danh từ<br />- tính không thể dát mỏng, tính không thể uốn (kim loại)<br />- (nghĩa bóng) tính khó bảo (trẻ con)</Q></N></I></F></C>'),
(131661, 'unmalleable', '<C><F><I><N><Q>@unmalleable /''ʌn''mæliəbl/<br />*  tính từ<br />- không thể dát mỏng, không thể uốn (kim loại)<br />- (nghĩa bóng) khó bảo (trẻ con)</Q></N></I></F></C>'),
(131662, 'unman', '<C><F><I><N><Q>@unman /''ʌn''mæm/<br />*  ngoại động từ<br />- làm cho yếu đuối, làm cho mềm yếu, làm cho nhu nhược<br />- làm nản lòng, làm thoái chí; làm mất can đảm, làm mất nhuệ khí<br />- (hàng hải) lấy người đi, bớt người làm (trên tàu)</Q></N></I></F></C>'),
(131663, 'unmanageability', '<C><F><I><N><Q>@unmanageability<br />- xem unmanageable</Q></N></I></F></C>'),
(131664, 'unmanageable', '<C><F><I><N><Q>@unmanageable /ʌn''mænidʤəbl/<br />*  tính từ<br />- khó trông nom, khó quản lý (công việc...)<br />- khó dạy; cứng đầu cứng cổ (trẻ con)<br />- khó cầm, khó sử dụng (đồ vật, máy móc...)<br />- khó làm chủ được, không làm chủ được (tình hình...)</Q></N></I></F></C>'),
(131665, 'unmanageableness', '<C><F><I><N><Q>@unmanageableness /ʌn''mænidʤəblnis/<br />*  danh từ<br />- tính khó trông nom, tính khó quản lý (công việc...)<br />- tính khó dạy; tính cứng đầu cứng cổ (trẻ con)<br />- tính khó cầm, tính khó sử dụng (đồ vật, máy móc...)<br />- tính khó làm chủ (tình hình...)</Q></N></I></F></C>'),
(131666, 'unmanageably', '<C><F><I><N><Q>@unmanageably<br />- xem unmanageable</Q></N></I></F></C>'),
(131667, 'unmanful', '<C><F><I><N><Q>@unmanful /''ʌn''mænful/<br />*  tính từ<br />- nhát gan; thiếu kiên quyết</Q></N></I></F></C>'),
(131668, 'unmanifest', '<C><F><I><N><Q>@unmanifest<br />* tính từ<br />- không rõ ràng, không rành mạch, không rạch ròi</Q></N></I></F></C>'),
