(131670, 'unmanlike', '<C><F><I><N><Q>@unmanlike<br />* tính từ<br />- nhu nhược, tầm thường<br />- không đáng làm nam nhi</Q></N></I></F></C>'),
(131671, 'unmanliness', '<C><F><I><N><Q>@unmanliness<br />- xem unmanly</Q></N></I></F></C>'),
