(131674, 'unmannered', '<C><F><I><N><Q>@unmannered /ʌn''mænəli/ (unmannered) /''ʌn''mænəd/<br />*  tính từ<br />- tính bất lịch sự, vô lễ; vô giáo dục, mất dạy</Q></N></I></F></C>'),
