(131677, 'unmannerly', '<C><F><I><N><Q>@unmannerly /ʌn''mænəli/ (unmannered) /''ʌn''mænəd/<br />*  tính từ<br />- tính bất lịch sự, vô lễ; vô giáo dục, mất dạy</Q></N></I></F></C>'),
(131678, 'unmanning', '<C><F><I><N><Q>@unman /''ʌn''mæm/<br />*  ngoại động từ<br />- làm cho yếu đuối, làm cho mềm yếu, làm cho nhu nhược<br />- làm nản lòng, làm thoái chí; làm mất can đảm, làm mất nhuệ khí<br />- (hàng hải) lấy người đi, bớt người làm (trên tàu)</Q></N></I></F></C>'),
