(131771, 'unmorality', '<C><F><I><N><Q>@unmorality /''ʌnmə''ræliti/<br />*  danh từ<br />- sự thiếu đạo đức<br />- sự thiếu đức hạnh, sự thiếu phẩm hạnh, sự thiếu nhân cách<br />- sự thiếu giá trị đạo đức, sự thiếu ý nghĩa đạo đức</Q></N></I></F></C>'),
