(131781, 'unmourned', '<C><F><I><N><Q>@unmourned /''ʌn''mɔ:nd/<br />*  tính từ<br />- to die unmourned chết không ai than khóc, chết không ai thương tiếc</Q></N></I></F></C>'),
(131782, 'unmovable', '<C><F><I><N><Q>@unmovable /''ʌn''mu:vəbl/ (unmoveable) /''ʌn''mu:vəbl/<br />*  tính từ<br />- không thể di động, không thể di chuyển</Q></N></I></F></C>'),
(131783, 'unmoveable', '<C><F><I><N><Q>@unmoveable /''ʌn''mu:vəbl/ (unmoveable) /''ʌn''mu:vəbl/<br />*  tính từ<br />- không thể di động, không thể di chuyển</Q></N></I></F></C>'),
(131784, 'unmoved', '<C><F><I><N><Q>@unmoved /''ʌn''mu:vd/<br />*  tính từ<br />- không động đậy, không nhúc nhích<br />- (nghĩa bóng) không mủi lòng, thản nhiên</Q></N></I></F></C>'),
(131785, 'unmown', '<C><F><I><N><Q>@unmown /''ʌn''moun/<br />*  tính từ<br />- chưa cắt, chưa gặt (bằng liềm, hái)</Q></N></I></F></C>'),
(131786, 'unmuffle', '<C><F><I><N><Q>@unmuffle /''ʌn''mʌfl/<br />*  ngoại động từ<br />- lấy bọc đi, mở bọc ra; cởi khăn quấn</Q></N></I></F></C>'),
