(131797, 'unmuzzle', '<C><F><I><N><Q>@unmuzzle /''ʌn''mʌzl/<br />*  ngoại động từ<br />- không bịt mõm, không khoá mõm<br />- (nghĩa bóng) cho phép nói</Q></N></I></F></C>'),
(131798, 'unmysterious', '<C><F><I><N><Q>@unmysterious<br />* tính từ<br />- không bí mật, hiểu được</Q></N></I></F></C>'),
(131799, 'unnail', '<C><F><I><N><Q>@unnail /''ʌn''neil/<br />*  ngoại động từ<br />- nhổ đinh, nạy đinh</Q></N></I></F></C>'),
