(131803, 'unnational', '<C><F><I><N><Q>@unnational /''ʌn''næʃənl/<br />*  tính từ<br />- không có tính dân tộc, không dân tộc</Q></N></I></F></C>'),
(131804, 'unnatural', '<C><F><I><N><Q>@unnatural /ʌn''nætʃrəl/<br />*  tính từ<br />- trái với thiên nhiên<br />- không tự nhiên, giả tạo, gượng gạo<br />=an unnatural laugh+ cái cười gượng gạo<br />- thiếu tình cảm thông thường (mẹ đối với con...)<br />- ghê tởm, tày trời (tội ác, tính xấu...)</Q></N></I></F></C>'),
(131805, 'unnaturalise', '<C><F><I><N><Q>@unnaturalise /''ʌn''nætʃrəlaiz/ (unnaturalize) /''ʌn''nætʃrəlaiz/<br />*  ngoại động từ<br />- làm cho trái với thiên nhiên<br />- làm cho gượng gạo<br />- làm mất tình cảm thông thường</Q></N></I></F></C>'),
(131806, 'unnaturalize', '<C><F><I><N><Q>@unnaturalize /''ʌn''nætʃrəlaiz/ (unnaturalize) /''ʌn''nætʃrəlaiz/<br />*  ngoại động từ<br />- làm cho trái với thiên nhiên<br />- làm cho gượng gạo<br />- làm mất tình cảm thông thường</Q></N></I></F></C>'),
(131807, 'unnaturalized', '<C><F><I><N><Q>@unnaturalized /''ʌn''nætʃrəlaizd/<br />*  tính từ<br />- không được nhập quốc tịch, không được nhập vào (nước nào)</Q></N></I></F></C>'),
(131808, 'unnaturally', '<C><F><I><N><Q>@unnaturally<br />- xem unnatural</Q></N></I></F></C>'),
