(131810, 'unnavigable', '<C><F><I><N><Q>@unnavigable /''ʌn''nævigəbl/<br />*  tính từ<br />- tàu bè không qua lại được (sông ngòi)</Q></N></I></F></C>'),
(131811, 'unnecessaries', '<C><F><I><N><Q>@unnecessaries /ʌn''nesisəriz/<br />*  danh từ số nhiều<br />- những cái vô ích</Q></N></I></F></C>'),
