(131816, 'unneedful', '<C><F><I><N><Q>@unneedful /''ʌn''ni:dful/<br />*  tính từ<br />- không cần, không cần thiết; vô dụng<br />=to be unneedful of something+ không cần đến vật gì</Q></N></I></F></C>'),
(131817, 'unnegotiable', '<C><F><I><N><Q>@unnegotiable /''ʌnni''gouʃjəbl/<br />*  tính từ<br />- không thể thương lượng được<br />- không thể đổi thành tiền, không thể chuyển cho người khác để lấy tiền (chứng khoán, ngân phiếu)<br />- không thể đi qua được (đường sá), không thể vượt qua được (vật chướng ngại)</Q></N></I></F></C>'),
(131818, 'unneighbourliness', '<C><F><I><N><Q>@unneighbourliness /''ʌn''neibəlinis/<br />*  danh từ<br />- sự không có tình xóm giềng; tình trạng không thuận hoà với xóm giềng</Q></N></I></F></C>'),
(131819, 'unneighbourly', '<C><F><I><N><Q>@unneighbourly /''ʌn''neibəli/<br />*  tính từ<br />- không có tình xóm giềng; không thuận hoà với xóm giềng</Q></N></I></F></C>'),
(131820, 'unnerved', '<C><F><I><N><Q>@unnerved /''ʌn''nə:vd/<br />*  tính từ<br />- bị làm suy nhược<br />- mất can đảm, mất nhuệ khí<br />- (từ cổ,nghĩa cổ) mất bình tĩnh, tức tối</Q></N></I></F></C>'),
(131821, 'unnerving', '<C><F><I><N><Q>@unnerving<br />* tính từ<br />- xem unnerve</Q></N></I></F></C>'),
