(131823, 'unnest', '<C><F><I><N><Q>@unnest /''ʌn''nest/<br />*  ngoại động từ<br />- phá tổ (chim, chuột)<br />- lôi ra, kéo ra</Q></N></I></F></C>'),
(131824, 'unnevre', '<C><F><I><N><Q>@unnevre /''ʌn''nə:v/<br />*  ngoại động từ<br />- làm cho yếu đuối, làm suy nhược<br />- (nghĩa bóng) làm nản lòng, làm mất can đảm, làm mất nhuệ khí<br />- (từ cổ,nghĩa cổ) làm mất bình tĩnh, trêu tức</Q></N></I></F></C>'),
(131825, 'unnoisy', '<C><F><I><N><Q>@unnoisy<br />* tính từ<br />- không đao to búa lớn (văn)<br />- không sặc sỡ, không loè loẹt (màu sắc)<br />- không ồn ào, không om sòm, không huyên náo</Q></N></I></F></C>'),
(131826, 'unnoted', '<C><F><I><N><Q>@unnoted /''ʌn''noutid/<br />*  tính từ<br />- không ai chú ý, không ai để ý đến<br />- vô danh, không tiếng tăm (người); không quan trọng, không đáng kể (việc)</Q></N></I></F></C>'),
(131827, 'unnoteworthy', '<C><F><I><N><Q>@unnoteworthy<br />* tính từ<br />- không đáng chú ý, không đáng để ý, không đáng lưu ý</Q></N></I></F></C>'),
(131828, 'unnoticeable', '<C><F><I><N><Q>@unnoticeable /''ʌn''noutisəbl/<br />*  tính từ<br />- không đang để ý, không đáng chú ý<br />- không thấy rõ, không rõ rệt</Q></N></I></F></C>'),
(131829, 'unnoticeably', '<C><F><I><N><Q>@unnoticeably<br />- xem unnoticeable</Q></N></I></F></C>'),
(131830, 'unnoticed', '<C><F><I><N><Q>@unnoticed /''ʌn''noutist/<br />*  tính từ<br />- không ai thấy, không ai để ý<br />=time slipped by unnoticed+ thời gian trôi qua không ai thấy<br />- bị bỏ qua, bị làm ngơ, bị coi là thường</Q></N></I></F></C>'),
(131831, 'unnotified', '<C><F><I><N><Q>@unnotified<br />* tính từ<br />- không báo cho biết<br />- không thông báo<br />- không khai báo</Q></N></I></F></C>'),
(131832, 'unnourished', '<C><F><I><N><Q>@unnourished /''ʌn''nʌriʃt/<br />*  tính từ<br />- không được nuôi dưỡng</Q></N></I></F></C>'),
