(131841, 'unobliging', '<C><F><I><N><Q>@unobliging /''ʌnə''blaidʤiɳ/<br />*  tính từ<br />- không sẵn lòng giúp đỡ, không sốt sắng</Q></N></I></F></C>'),
(131842, 'unobliterated', '<C><F><I><N><Q>@unobliterated /''ʌnəb''blitəreitid/<br />*  tính từ<br />- không tẩy xoá; không bị đóng dấu (tem)</Q></N></I></F></C>'),
