(131844, 'unobscured', '<C><F><I><N><Q>@unobscured /''ʌnəb''skjuəd/<br />*  tính từ<br />- không bị làm tối, không bị làm mờ</Q></N></I></F></C>'),
(131845, 'unobservable', '<C><F><I><N><Q>@unobservable<br />* tính từ<br />- khó thấy<br />- khó phân biệt<br />- không dễ quan sát<br /><br />@unobservable<br />- không quan sát được</Q></N></I></F></C>'),
(131846, 'unobservance', '<C><F><I><N><Q>@unobservance /''ʌnəb''zə:vəns/<br />*  danh từ<br />- sự không tuân theo (quy tắc); sự vi phạm (luật)</Q></N></I></F></C>'),
