(132028, 'unpliant', '<C><F><I><N><Q>@unpliant /''ʌn''plaiəbl/ (unpliant) /''ʌn''plaiənt/<br />*  tính từ<br />- không dễ uốn, không dẻo; không mềm<br />- (nghĩa bóng) không dễ uốn nắn, không dễ bảo; không mềm dẻo; không hay nhân nhượng</Q></N></I></F></C>'),
