(132037, 'unpoetic', '<C><F><I><N><Q>@unpoetic /''ʌnpou''etik/ (unpoetical) /''ʌnpou''etikəl/<br />*  tính từ<br />- không phải là thơ ca<br />- không hợp với thơ<br />- không viết bằng thơ<br />- không thi vị, không nên thơ</Q></N></I></F></C>'),
