(132099, 'unpretending', '<C><F><I><N><Q>@unpretending /''ʌnpri''tenʃəs/ (unpretending) /''ʌnpri''tendiɳ/<br />*  tính từ<br />- không tự phụ, không kiêu căng, khiêm tốn</Q></N></I></F></C>'),
