(133254, 'unwritten', '<C><F><I><N><Q>@unwritten /'' n''ritn/<br />*  tính từ<br />- không viết ra, nói miệng<br />- chưa viết, trắng (giấy)<br />=unwritten law+ (pháp lý) luật do tập quán quy định; (từ Mỹ,nghĩa Mỹ) thuyết cho rằng giết người để bo vệ <br />danh dự cá nhân là chính đáng</Q></N></I></F></C>'),
(133255, 'unwrought', '<C><F><I><N><Q>@unwrought /'' n''r :t/<br />*  tính từ<br />- chưa gia công (kim loại); chưa khai thác (mỏ)<br />- (từ cổ,nghĩa cổ); (th ca) chưa làm; chưa hoàn thành</Q></N></I></F></C>'),
(133256, 'unwrung', '<C><F><I><N><Q>@unwrung /'' n''r  /<br />*  tính từ<br />- không vặn, không vắt<br />!my withers are unwrung<br />- (xem) withers</Q></N></I></F></C>'),
(133257, 'unyielding', '<C><F><I><N><Q>@unyielding / n''ji:ldi /<br />*  tính từ<br />- cứng, không oằn, không cong<br />- không chịu khuất phục, không chịu nhượng bộ; cứng cỏi</Q></N></I></F></C>'),
(133258, 'unyieldingly', '<C><F><I><N><Q>@unyieldingly<br />- xem unyielding</Q></N></I></F></C>'),
