(133260, 'unyoke', '<C><F><I><N><Q>@unyoke /'' njouk/<br />*  động từ<br />- cởi ách (bò, ngựa)<br />- nghỉ làm việc</Q></N></I></F></C>'),
(133261, 'unyoked', '<C><F><I><N><Q>@unyoked /'' n''joukt/<br />*  tính từ<br />- được cởi ách (bò, ngựa)<br />- được nghỉ làm việc</Q></N></I></F></C>'),
(133262, 'unyouthful', '<C><F><I><N><Q>@unyouthful /'' n''ju: ful/<br />*  tính từ<br />- không còn trẻ<br />- không phi tuổi thanh niên, không phi tuổi trẻ</Q></N></I></F></C>'),
(133263, 'unzealous', '<C><F><I><N><Q>@unzealous /'' n''zel s/<br />*  tính từ<br />- không sốt sắng, không hăng hái; không nhiệt tâm, không có nhiệt huyết</Q></N></I></F></C>'),
(133264, 'unzip', '<C><F><I><N><Q>@unzip<br />* ngoại động từ<br />- mở khoá kéo, mở phécmơtuya</Q></N></I></F></C>'),
(133265, 'unzipped', '<C><F><I><N><Q>@unzip<br />* ngoại động từ<br />- mở khoá kéo, mở phécmơtuya</Q></N></I></F></C>'),
(133266, 'unzipping', '<C><F><I><N><Q>@unzip<br />* ngoại động từ<br />- mở khoá kéo, mở phécmơtuya</Q></N></I></F></C>'),
(133267, 'unzips', '<C><F><I><N><Q>@unzip<br />* ngoại động từ<br />- mở khoá kéo, mở phécmơtuya</Q></N></I></F></C>'),
(133268, 'up', '<C><F><I><N><Q>@up / p/<br />*  phó từ<br />- ở trên, lên trên, lên<br />=up in the air+ ở trên cao trong không trung<br />- dậy, đứng lên, đứng dậy<br />=to get up early+ dậy sớm<br />=the whole nation was up in arms against the invaders+ c nước đ  đứng lên cầm vũ khí chống quân xâm lược<br />- đến, tới ((thường) là một địa điểm quan trọng, hoặc một địa điểm ở phía bắc)<br />=whe are you going up to London?+ khi nào anh đi Luân đôn?<br />=to go up to the door+ đến tận cửa<br />- hết, hoàn toàn, xong ((cũng) U.P.)<br />=time is up+ hết giờ rồi<br />=to fill up a glass+ rót đầy cốc<br />=it''s all up+ đ  hoàn toàn xong c rồi<br />- cừ, giỏi, thông thạo<br />=to be well up in English+ giỏi tiếng Anh<br />- (+ động từ) to lên, mạnh lên, lên<br />=speak up!+ nói to lên!<br />=to blow up the fire+ thổi lửa lên<br />!up against<br />- đưng đầu với (khó khăn, trở ngại...)<br />!up and down<br />- đi đi lại lại, lên lên xuống xuống; khắp chốn, khắp ni, mọi chỗ<br />=to walk up and down+ đi đi lại lại<br />=to look for something up and down+ tìm cái gì khắp mọi chỗ<br />!up to<br />- bận, đang làm<br />=what''s he up to?+ hắn ta đang làm gì?<br />=what tricks has he been up to?+ hắn đang dở những trò gì thế?<br />- xứng đáng; đủ sức, đủ kh năng<br />=not to feel up to something+ cm thấy không đủ kh năng làm việc gì<br />- cho đến, đến<br />=up to now+ đến nay<br />=from one up to one hundred+ từ một đến một trăm<br />- phi, có nhiệm vụ phi<br />=it is up to us to...+ chúng ta có nhiệm vụ phi...<br />!what''s up?<br />- có việc gì thế?<br />*  giới từ<br />- lên, ngược lên; ở trên<br />=up hill and down dale+ lên dốc xuống đèo<br />=to go up the river+ đi ngược dòng sông<br />=up the hill+ ở trên đồi<br />- ngược (gió, dòng nước...)<br />=up the wind+ ngược gió<br />- ở cuối<br />=up the yard+ ở cuối sân<br />*  tính từ<br />- lên (đi về một thành phố lớn hay thủ đô), ngược (đi về hướng bắc)<br />=an up train+ chuyến tàu về thủ đô; chuyến tàu ngược<br />*  danh từ<br />- sự lên, sự thăng<br />=ups and downs+ sự lên xuống, sự thăng trầm (của cuộc đời)<br />- (từ Mỹ,nghĩa Mỹ) người đang lên<br />- (từ Mỹ,nghĩa Mỹ) dốc lên<br />- sự thành công<br />- chuyến tàu về (thủ đô); chuyến tàu ngược<br />*  nội động từ<br />- (thông tục) đột nhiên đứng dậy; đột nhiên nói; đột nhiên làm<br />- tăng vọt lên (giá c, mức sn xuất...)</Q></N></I></F></C>'),
