(133522, 'use', '<C><F><I><N><Q>@use /ju:s/<br />*  danh từ<br />- sự dùng; cách dùng<br />=to put to use+ đưa ra dùng<br />=in common use+ thường dùng<br />=in use+ được dùng, thông dụng<br />=out of use+ không dùng nữa<br />- quyền dùng, quyền sử dụng<br />=to have the use of something+ được quyền dùng cái gì<br />- năng lực sử dụng<br />=to lose the use of one''s eyes+ mất năng lực sử dụng con mắt<br />- thói quen, tập quán<br />=in these cases use is the best guide+ trong những trường hợp này theo thói quen là tốt nhất<br />- sự có ích; ích lợi<br />=to be of use for+ có ích cho, dùng được cho<br />=to have no further use for+ không dùng làm gì nữa, không cần đến nữa<br />- (tôn giáo) lễ nghi<br />- (pháp lý) quyền hoa lợi<br />*  ngoại động từ<br />- dùng, sử dụng<br />=to use something+ dùng vật gì<br />=to be used for+ được dùng để<br />- dùng, áp dụng, lợi dụng<br />=to use every means+ dùng đủ mọi cách<br />=to use one''s opportunities+ lợi dụng c hội<br />=to use someone+ lợi dụng ai<br />- tiêu dùng, tiêu thụ<br />=to use up all one''s provisions+ dùng hết lưng ăn để dành<br />- đối xử, đối đ i, ăn ở<br />=use others as you would have them use you+ h y đối xử người khác như mình muốn họ đối xử với mình<br />- (chỉ thời quá khứ) trước kia có thói quen, trước kia hay<br />=it used to be said that+ trước kia người ta thường nói rằng<br />=there used to be a house here+ trước kia ở đây có một ngôi nhà<br />=he usedn''t to drink; (mỹ) he didn''t use to drink+ trước kia nó không quen uống rượu<br />!to use up<br />- dùng cho đến hết tiệt<br />- tận dụng (những cái còn thừa)<br />- dùng cho đến kiệt sức (người, ngựa)<br /><br />@use<br />- dùng</Q></N></I></F></C>'),
(133523, 'Use value and exchange value', '<C><F><I><N><Q>@Use value and exchange value<br />- (Econ) Giá trị sử dụng và giá trị trao đổi.<br />+ Một sự phân biệt, mà làm chủ đề thảo luận từ thời AISTOTLE đến C.Mác, giữa độ thoả dụng có được từ hàng hóa và giá cả của nó.</Q></N></I></F></C>'),
