(133585, 'Utilitarianism', '<C><F><I><N><Q>@Utilitarianism<br />- (Econ) Chủ nghĩa vị lợi.<br />+ Thuật gữ chính trị và triết học miêu tả các thuyết của BENTHAM và các cộng sự của ông, những người lấy nguyên tắc hạnh phúc lớn nhất của số đông nhất làm tiêu trí đánh giá hành động.</Q></N></I></F></C>'),
