(133620, 'utters', '<C><F><I><N><Q>@utter /'' t /<br />*  tính từ<br />- hoàn toàn<br />=an utter darkness+ sự tối hoàn toàn, sự tối như mực<br />=an utter denial+ lời từ chối dứt khoát; sự phủ nhận dứt khoát<br />*  ngoại động từ<br />- thốt ra, phát ra<br />=to utter a sigh+ thốt ra một tiếng thở dài<br />- nói, nói ra, phát biểu, bày tỏ<br />=to utter a lie+ nói láo<br />=not to utter a word+ không nói nửa lời<br />=to utter one''s feelings+ phát biểu cm tưởng<br />- cho lưu hành, phát hành (bạc gi...)</Q></N></I></F></C>'),
(133621, 'uucp', '<C><F><I><N><Q>@uucp<br />- Từ vt của UNIX - to - UNIX Copy Protocol, một giao thức truyền thông trước đây dùng cho các máy tính chạy với UNIX, nó đòi hỏi phải có một máy gọi máy kia qua điện thoại</Q></N></I></F></C>'),
(133622, 'uudecode', '<C><F><I><N><Q>@uudecode<br />- Một chương trình dùng để biến đổi một tệp do chương trình uuencode tạo ra thành tệp nhị phân sao cho bạn có thể phục hồi lại tệp này trong chương trình đã được dùng để tạo ra nó</Q></N></I></F></C>'),
(133623, 'uuencode', '<C><F><I><N><Q>@uuencode<br />- Một trình tiện ích được sử dụng cùng với UNIX và mạng Internet, nhằm chuyển đổi mã của một tệp nhị phân (bằng một chương trình như Word Perfect chẳng hạn) thành ra các ký tự ASCII, cho nên tệp đó có thể chuyển qua một dịch vụ chỉ tiếp nhận các tệp văn bản</Q></N></I></F></C>'),
