(133847, 'valuable', '<C><F><I><N><Q>@valuable /''væljuəbl/<br />*  tính từ<br />- có giá trị lớn, quý giá<br />=valuable assistance+ sự giúp đỡ quý giá<br />- có thể đánh giá được, có thể định giá được<br />=a service not valuable in money+ một sự giúp đỡ không thể lấy tiền mà đánh giá được<br />*  danh từ<br />- ((thường) số nhiều) đồ quý giá</Q></N></I></F></C>'),
