(133851, 'valuation', '<C><F><I><N><Q>@valuation /,vælju''eiʃn/<br />*  danh từ<br />- sự định giá, sự đánh giá<br />=to make a valuation of the goods+ định giá hàng hoá<br />=to set a high valuation of someone''s abilities+ đánh giá cao khả năng của ai<br />- giá<br />=to dispose of something at a low valuation+ bán tống cái gì đi với một giá thấp<br />- giá trị<br /><br />@valuation<br />- ước lượng; (đại số) đánh giá; định giá; sự chuẩn hoá; mêtric hoá<br />- discrete v. (đại số) sự định giá rời rạc<br />- effective v. (đại số) đánh giá có hiệu quả</Q></N></I></F></C>'),
(133852, 'Valuation curve', '<C><F><I><N><Q>@Valuation curve<br />- (Econ) Đường đánh giá.<br />+ Xem GROWTH - VALUATION FUNCTION.</Q></N></I></F></C>'),
(133853, 'Valuation ratio', '<C><F><I><N><Q>@Valuation ratio<br />- (Econ) Tỷ số đánh giá.<br />+ Tỷ số giữa thị giá cổ phần của hãng, V, với giá trị sổ sách  tài sản của nó, K.</Q></N></I></F></C>'),
(133854, 'valuational', '<C><F><I><N><Q>@valuational<br />- xem valuation</Q></N></I></F></C>'),
(133855, 'valuations', '<C><F><I><N><Q>@valuation /,vælju''eiʃn/<br />*  danh từ<br />- sự định giá, sự đánh giá<br />=to make a valuation of the goods+ định giá hàng hoá<br />=to set a high valuation of someone''s abilities+ đánh giá cao khả năng của ai<br />- giá<br />=to dispose of something at a low valuation+ bán tống cái gì đi với một giá thấp<br />- giá trị<br /><br />@valuation<br />- ước lượng; (đại số) đánh giá; định giá; sự chuẩn hoá; mêtric hoá<br />- discrete v. (đại số) sự định giá rời rạc<br />- effective v. (đại số) đánh giá có hiệu quả</Q></N></I></F></C>'),
(133856, 'valuator', '<C><F><I><N><Q>@valuator /''væljueitə/<br />*  danh từ<br />- người định giá</Q></N></I></F></C>'),
(133857, 'valuators', '<C><F><I><N><Q>@valuator /''væljueitə/<br />*  danh từ<br />- người định giá</Q></N></I></F></C>'),
(133858, 'value', '<C><F><I><N><Q>@value /''vælju:/<br />*  danh từ<br />- giá trị<br />=of a great value+ có giá trị lớn, quý<br />=of no value+ không có giá trị<br />=to be of value+ có giá trị<br />=to set a value on+ đánh giá<br />=to set a low value on something+ coi rẻ vật gì<br />=to set too much value on+ đánh giá quá cao về<br />- (thương nghiệp); (tài chính) giá cả, giá<br />=to lose value+ mất giá, giảm giá<br />=fall in value+ sự sụt giá<br />=commercial value+ giá thị trường<br />=market value+ thời giá, giá thị trường<br />=exchange value+ giá trị trao đổi<br />=to get good value for one''s money+ mua được cái xứng với đồng tiền mình bỏ ra<br />- (vật lý) năng suất<br />=calorific value+ năng suất toả nhiệt<br />- (văn học) nghĩa, ý nghĩa<br />=the poetic value of a word+ ý nghĩa về mặt thơ của một từ<br />- (sinh vật học) bậc phân loại<br />- (số nhiều) tiêu chuẩn<br />=moral values+ tiêu chuẩn đạo đức<br />*  ngoại động từ<br />- (thương nghiệp) định giá<br />=to value goods+ định giá hàng hoá<br />- đánh giá<br />- trọng, chuộng, quý, coi trọng<br />=to value one''s reputation+ coi trọng danh giá của mình<br />- hãnh diện, vênh vang<br />=to value oneself on one''s knowledge+ hãnh diện về kiến thức của mình<br /><br />@value<br />- giá trị<br />- v. of a game (lý thuyết trò chơi) Giá trị của trò chơi<br />- v. of an insurance policy giá trị của chế độ bảo hiểm<br />- v. of series giá trị của chuỗi<br />- v. of variables giá trị của biến số<br />- alsolute v. giá trị tuyệt đối<br />- accumutated v. of an annuity giá trị của tích luỹ một năn <br />- algebraic v. giá trị đại số <br />- approximate v. giá trị xấp xỉ, giá trị gần đúng <br />- asymptotic(al) v. giá trị tiệm cận<br />- average v. giá trị trung bình<br />- boundary v. giá trị biên<br />- Cauchy principal v. giá trị của chính Cauxi<br />- characteristic v. giá trị đặc trưng<br />- critical v. giá trị tới hạn<br />- defective v. (giải tích) giá trị khuyết<br />- end v. giá trị cuối<br />- exchange v. giá trị trao đổi<br />- expected v. (thống kê) kỳ vọng, giá trị kỳ vọng<br />- face v. giá trị bề mặt<br />- improved v. giá trị đã hiệu chỉnh<br />- inaccessible v. giá trị không đạt được<br />- isolated v. giá trị cô lập<br />- market v. giá trị thường<br />- maximal v. giá trị cực đại<br />- mean v. giá trị trung bình<br />- minimum v. giá trị cực tiểu<br />- modal v. (thống kê) giá trị có tần suất cao nhất, giá trị mốt<br />- numerical v. giá trị bằng số<br />- observed v. giá trị quan sát<br />- par v. giá trị pháp đỉnh<br />- permissible v. giá trị cho phép<br />- predicted v. giá trị tiên đoán<br />- present v. giá trị hiện có<br />- principal v. giá trị chính<br />- provable v. giá trị có thể<br />- proper v. giá trị riêng<br />- reduced v. giá trị thu gọn<br />- stationary v. giá trị dừng<br />- surplus v. (toán kinh tế) giá trị thặng dư<br />- true v. giá trị đúng<br />- truth v. (logic học) giá trị chân lý</Q></N></I></F></C>'),
(133859, 'Value added', '<C><F><I><N><Q>@Value added<br />- (Econ) Giá trị gia tăng.<br />+ Giá trị sản lượng của một hãng trừ đi giá trị đầu vào nó mua từ các hãng khác.</Q></N></I></F></C>'),
(133860, 'Value-added tax', '<C><F><I><N><Q>@Value-added tax<br />- (Econ) Thuế Giá trị gia tăng.<br />+ Về mặt khái nịêm đây là loại thuế dựa trên giá trị gia tăng trong một quốc gia.</Q></N></I></F></C>'),
(133861, 'value added tax', '<C><F><I><N><Q>@value added tax<br />* danh từ<br />- &lt;vt&gt;  VAT thuế giá trị gia tăng (thuế đánh vào sự tăng giá trị của một sản phẩm ở mỗi giai đoạn sản xuất)</Q></N></I></F></C>'),
(133862, 'Value judgement', '<C><F><I><N><Q>@Value judgement<br />- (Econ) Đánh giá chủ quan.<br />+ Một nhận định mà nói chung có thể được tóm tắt là X là tốt (hay xấu). Cụm thuật ngữ chủ quan gây nhiều nhầm lẫn trong kinh tế học.</Q></N></I></F></C>'),
(133863, 'value judgement', '<C><F><I><N><Q>@value judgement<br />* danh từ<br />- sự đánh giá (giá trị đạo đức, &lt;nghệ&gt;</Q></N></I></F></C>'),
(133864, 'Value marginal physical product', '<C><F><I><N><Q>@Value marginal physical product<br />- (Econ) Sản phẩm vật chất giá trị biên.<br />+ Xem MARGINAL REVENUE PRODUCT.</Q></N></I></F></C>'),
(133865, 'Value, money, a standard of', '<C><F><I><N><Q>@Value, money, a standard of<br />- (Econ) Tiêu chuẩn giá trị của tiền.<br />+ Một trong các chức năng của tiền là vai trò tiêu chuẩn giá trị. Nghĩa là nó tạo một hệ thống đơn vị kế toán mà qua đó giá cả được biểu hiện và các khoản trả chậm như nợ được xác định.</Q></N></I></F></C>'),
(133866, 'Value, theory of', '<C><F><I><N><Q>@Value, theory of<br />- (Econ) Lý thuyết về giá trị.<br />+ Gía trị nội tại của một hàng hoá.</Q></N></I></F></C>'),
