(133955, 'vanquishable', '<C><F><I><N><Q>@vanquishable /''væɳkwiʃəbl/<br />*  tính từ<br />- có thể bị đánh bại, có thể chiến thắng<br />- có thể chế ngự được</Q></N></I></F></C>'),
(133956, 'vanquished', '<C><F><I><N><Q>@vanquished<br />* tính từ<br />- bị đánh bại, bị chế ngự</Q></N></I></F></C><C><F><I><N><Q>@vanquish /''væɳkwiʃ/<br />*  ngoại động từ<br />- thắng, đánh bại<br />=to vanquish the enemy+ đánh bại kẻ thù<br />- chế ngự<br />=to vanquish one''s desires+ chế ngự dục vọng</Q></N></I></F></C>'),
(133957, 'vanquisher', '<C><F><I><N><Q>@vanquisher /''væɳkwiʃə/<br />*  danh từ<br />- người chiến thắng<br />- người chế ngự được (dục vọng của mình)</Q></N></I></F></C>'),
(133958, 'vanquishes', '<C><F><I><N><Q>@vanquish /''væɳkwiʃ/<br />*  ngoại động từ<br />- thắng, đánh bại<br />=to vanquish the enemy+ đánh bại kẻ thù<br />- chế ngự<br />=to vanquish one''s desires+ chế ngự dục vọng</Q></N></I></F></C>'),
(133959, 'vanquishing', '<C><F><I><N><Q>@vanquish /''væɳkwiʃ/<br />*  ngoại động từ<br />- thắng, đánh bại<br />=to vanquish the enemy+ đánh bại kẻ thù<br />- chế ngự<br />=to vanquish one''s desires+ chế ngự dục vọng</Q></N></I></F></C>'),
(133960, 'vanquishment', '<C><F><I><N><Q>@vanquishment<br />- xem vanquish</Q></N></I></F></C>'),
(133961, 'vans', '<C><F><I><N><Q>@van /væn/<br />*  danh từ<br />- (quân sự) tiền đội, quân tiên phong<br />- những người đi tiên phong, những người lãnh đạo (một phong trào); địa vị hàng đầu<br />=men in the van of the movement+ những người đi tiên phong trong phong trào<br />=in the van of nations fighting for independence+ ở hàng đầu trong các nước đang đấu tranh giành độc lập<br />*  danh từ<br />- xe hành lý, xe tải<br />- (ngành đường sắt) toa hành lý, toa hàng ((cũng) luggage van)<br />*  ngoại động từ<br />- chuyên chở bằng xe tải<br />*  danh từ<br />- (từ cổ,nghĩa cổ) máy quạt thóc<br />- (từ cổ,nghĩa cổ); (thơ ca) cánh chim<br />*  ngoại động từ<br />- đãi (quặng)</Q></N></I></F></C>'),
(133962, 'vantage', '<C><F><I><N><Q>@vantage /''vɑ:ntidʤ/<br />*  danh từ<br />- sự thuận lợi, sự hơn thế<br />=place (point) of vantage+ vị trí thuận lợi<br />=to have someone at vantage+ chiếm ưu thế so với ai, thắng thế ai<br />- (thể dục,thể thao) phần thắng</Q></N></I></F></C>'),
(133963, 'vantage-ground', '<C><F><I><N><Q>@vantage-ground /''vɑ:ntidʤ''graund/ (vantage-point) /''vɑ:ntidʤpɔint/<br />-point) <br />/''vɑ:ntidʤpɔint/<br />*  danh từ<br />- thế lợi, ưu thế</Q></N></I></F></C>'),
(133964, 'vantage-point', '<C><F><I><N><Q>@vantage-point /''vɑ:ntidʤ''graund/ (vantage-point) /''vɑ:ntidʤpɔint/<br />-point) <br />/''vɑ:ntidʤpɔint/<br />*  danh từ<br />- thế lợi, ưu thế</Q></N></I></F></C>'),
