(133966, 'vanward', '<C><F><I><N><Q>@vanward<br />- trạng từ<br />- hướng ra tuyền tuyến<br />- tiến lên phía trước<br />* tính từ<br />- tiêm kích, tiên phong<br />- thuộc tuyến đầu</Q></N></I></F></C>'),
(133967, 'vapid', '<C><F><I><N><Q>@vapid /''væpid/<br />*  tính từ<br />- nhạt, nhạt nhẽo<br />=vapid beer+ bia nhạt<br />=a vapid conversation+ cuộc nói chuyện nhạt nhẽo</Q></N></I></F></C>'),
