(133970, 'vapidness', '<C><F><I><N><Q>@vapidness /''væpidnis/<br />*  danh từ<br />- tính chất nhạt nhẽo ((cũng) vapidity)</Q></N></I></F></C>'),
(133971, 'vapor', '<C><F><I><N><Q>@vapor /''veipə/<br />*  danh từ &amp; nội động từ<br />- (từ Mỹ,nghĩa Mỹ) (như) vapour</Q></N></I></F></C>'),
(133972, 'vaporable', '<C><F><I><N><Q>@vaporable<br />* tính từ<br />- có thể biến thành hơi, có thể bốc hơi</Q></N></I></F></C>'),
