(133977, 'vaporific', '<C><F><I><N><Q>@vaporific<br />* tính từ<br />- liên quan đến việc tạo thành hơi<br />- tạo sự bốc hơi</Q></N></I></F></C>'),
(133978, 'vaporimeter', '<C><F><I><N><Q>@vaporimeter<br />* danh từ<br />- chưng khí biểu<br />- đồng hồ đo hơi</Q></N></I></F></C>'),
(133979, 'vaporisation', '<C><F><I><N><Q>@vaporisation<br />* danh từ(như vaporizing<br />- sự làm bốc hơi; sự biến thành hơi nước<br />- sự xì, sự bơm (nước hoa )<br />* danh từ<br />- &lt;y&gt; phép chữa bằng hơi</Q></N></I></F></C>'),
(133980, 'vaporise', '<C><F><I><N><Q>@vaporise /''veipəraiz/ (vaporise) /''veipəraiz/<br />*  ngoại động từ<br />- làm cho bốc hơi<br />- xì, bơm (nước hoa...)<br />*  nội động từ<br />- bốc hơi, lên hơi</Q></N></I></F></C>'),
(133981, 'vaporizable', '<C><F><I><N><Q>@vaporizable /''veipəraizəbl/<br />*  tính từ<br />- có thể bốc hơi</Q></N></I></F></C>'),
(133982, 'vaporization', '<C><F><I><N><Q>@vaporization /,veipərai''zeiʃn/<br />*  danh từ ((cũng) vaporizing)<br />- sự bốc hơi<br />- sự xì, sự bơm (nước hoa)<br />*  danh từ<br />- (y học) phép chữa bằng hơi<br /><br />@vaporization<br />- (vật lí) sự bốc hơi, sự hoá hơi</Q></N></I></F></C>'),
(133983, 'vaporizations', '<C><F><I><N><Q>@vaporization /,veipərai''zeiʃn/<br />*  danh từ ((cũng) vaporizing)<br />- sự bốc hơi<br />- sự xì, sự bơm (nước hoa)<br />*  danh từ<br />- (y học) phép chữa bằng hơi<br /><br />@vaporization<br />- (vật lí) sự bốc hơi, sự hoá hơi</Q></N></I></F></C>');